INSERT INTO `CONTENT` (`contentID`, `title`, `language`, `genre`, `releaseDate`, `rating`, `productionStudio`, `image`, `summary`, `runtime`) VALUES
(1, 'Under the Dome', 'English', 'Thriller', '2013-06-24', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/81/202627.jpg', 'Under the Dome is the story of a small town that is suddenly and inexplicably sealed off from the rest of the world by an enormous transparent dome. The town\'s inhabitants must deal with surviving the post-apocalyptic conditions while searching for answers about the dome, where it came from and if and when it will go away.', 60),
(2, 'Person of Interest', 'English', 'Adventure', '2011-09-22', 9, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/163/407679.jpg', 'You are being watched. The government has a secret system, a machine that spies on you every hour of every day. I know because I built it. I designed the Machine to detect acts of terror but it sees everything. Violent crimes involving ordinary people. People like you. Crimes the government considered \"irrelevant\". They wouldn\'t act so I decided I would. But I needed a partner. Someone with the skills to intervene. Hunted by the authorities, we work in secret. You\'ll never find us. But victim or perpetrator, if your number is up, we\'ll find you.', 60),
(3, 'Bitten', 'English', 'Thriller', '2014-01-11', 7, 'CTV Sci-Fi Channel', 'https://static.tvmaze.com/uploads/images/original_untouched/0/15.jpg', 'Based on the critically acclaimed series of novels from Kelley Armstrong. Set in Toronto and upper New York State, Bitten follows the adventures of 28-year-old Elena Michaels, the world\'s only female werewolf. An orphan, Elena thought she finally found her \"happily ever after\" with her new love Clayton, until her life changed forever. With one small bite, the normal life she craved was taken away and she was left to survive life with the Pack.', 60),
(4, 'Arrow', 'English', 'Thriller', '2012-10-10', 7, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/143/358967.jpg', 'After a violent shipwreck, billionaire playboy Oliver Queen was missing and presumed dead for five years before being discovered alive on a remote island in the Pacific. He returned home to Starling City, welcomed by his devoted mother Moira, beloved sister Thea and former flame Laurel Lance. With the aid of his trusted chauffeur/bodyguard John Diggle, the computer-hacking skills of Felicity Smoak and the occasional, reluctant assistance of former police detective, now beat cop, Quentin Lance, Oliver has been waging a one-man war on crime.', 60),
(5, 'True Detective', 'English', 'Thriller', '2014-01-12', 8, 'HBO', 'https://static.tvmaze.com/uploads/images/original_untouched/490/1226764.jpg', 'Touch darkness and darkness touches you back. True Detective centers on troubled cops and the investigations that drive them to the edge. Each season features a new cast and a new case.True Detective is an American anthology crime drama television series created and written by Nic Pizzolatto. ', 63),
(6, 'The 100', 'English', 'Adventure', '2014-03-19', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/477/1194981.jpg', 'Ninety-seven years ago, nuclear Armageddon decimated planet Earth, destroying civilization. The only survivors were the 400 inhabitants of 12 international space stations that were in orbit at the time. Three generations have been born in space, the survivors now number 4,000, and resources are running out on their dying \"Ark\" - the 12 stations now linked together and repurposed to keep the survivors alive. Draconian measures including capital punishment and population control are the order of the day, as the leaders of the Ark take ruthless steps to ensure their future, including secretly exiling a group of 100 juvenile prisoners to the Earth\'s surface to test whether it\'s habitable.', 60),
(7, 'Homeland', 'English', 'Thriller', '2011-10-02', 8, 'Showtime', 'https://static.tvmaze.com/uploads/images/original_untouched/498/1245275.jpg', 'The winner of 6 Emmy Awards including Outstanding Drama Series, Homeland is an edge-of-your-seat sensation. Marine Sergeant Nicholas Brody is both a decorated hero and a serious threat. CIA officer Carrie Mathison is tops in her field despite being bipolar. The delicate dance these two complex characters perform, built on lies, suspicion, and desire, is at the heart of this gripping, emotional thriller in which nothing short of the fate of our nation is at stake.', 60),
(8, 'Glee', 'English', 'Thriller', '2009-05-19', 7, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/0/73.jpg', 'Glee is a musical comedy about a group of ambitious and talented young adults in search of strength, acceptance and, ultimately, their voice.', 60),
(9, 'Revenge', 'English', 'Thriller', '2011-09-21', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/82/206879.jpg', 'This is not a story about forgiveness; Revenge is a show about retribution. Meet Emily Thorne, the newest resident of The Hamptons. When she was a little girl (and known as Amanda Clarke) her father, David Clarke, was framed for a horrific crime and subsequently sent to prison. While serving his time, the conspirators plotted and murdered David in order to prevent the truth from coming out. Emily is now back with a new identity and ready to take vengeance on the people that murdered her father and stole her childhood.', 60),
(10, 'Grimm', 'English', 'Thriller', '2011-10-28', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/69/174906.jpg', 'Grimm is a drama series inspired by the classic Grimm Brothers\' Fairy Tales. After Portland homicide detective Nick Burkhardt discovers he\'s descended from an elite line of criminal profilers known as \"Grimms\", he increasingly finds his responsibilities as a detective at odds with his new responsibilities as a Grimm.', 60),
(11, 'Gotham', 'English', 'Thriller', '2014-09-22', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/189/474715.jpg', 'The good. The evil. The beginning.Everyone knows the name Commissioner Gordon. He is one of the crime world\'s greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordon\'s story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the world\'s most iconic villains? And what circumstances created them – the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker?Gotham is an origin story of the great DC Comics Super-Villains and vigilantes, revealing an entirely new chapter that has never been told. It follows one cop\'s rise through a dangerously corrupt city teetering between good and evil, and chronicles the birth of one of the most popular super heroes of our time.', 60),
(12, 'Lost Girl', 'English', 'Thriller', '2010-09-12', 8, 'Showcase', 'https://static.tvmaze.com/uploads/images/original_untouched/0/137.jpg', 'Lost Girl follows supernatural seductress Bo, a Succubus who feeds on the sexual energy of humans. Growing up with human parents, Bo had no reason to believe she was anything other than the girl next door — until she drained her boyfriend to death in their first sexual encounter. Now she has hit the road alone and afraid.  She discovers she is one of the Fae, creatures of legend and folklore, who pass as humans while feeding off them secretly and in different ways, as they have for millennia. Relieved yet horrified to find out that she is not alone, Bo decides to take the middle path between the humans and the Fae while embarking on a personal mission to unlock the secrets of her origin.With the help of her human sidekick, Kenzi, and Dyson, a sexy police detective, Bo takes on a challenge every week helping a Fae or human client who comes to her to solve a mystery, or to right a wrong.', 60),
(13, 'The Flash', 'English', 'Thriller', '2014-10-07', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/448/1121792.jpg', 'After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only \"meta-human\" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won\'t be long before the world learns what Barry Allen has become...The Flash!', 60),
(14, 'Continuum', 'English', 'Thriller', '2012-05-27', 8, 'Showcase', 'https://static.tvmaze.com/uploads/images/original_untouched/0/184.jpg', 'Continuum centers on the conflict between a group of rebels from the year 2077 who time-travel to Vancouver, BC, in 2012, and a police officer who accidentally accompanies them. In spite of being many years early, the rebel group decides to continue its violent campaign to stop corporations of the future from replacing governments, while the police officer endeavours to stop them without revealing to anyone that she and the rebels are from the future.', 60),
(15, 'Constantine', 'English', 'Thriller', '2014-10-24', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/154.jpg', 'Based on the wildly popular comic book series \"Hellblazer\" from DC Comics, seasoned demon hunter and master of the occult John Constantine is armed with a ferocious knowledge of the dark arts and a wickedly naughty wit. He fights the good fight - or at least he did. With his soul already damned to hell, he\'s decided to abandon his campaign against evil until a series of events thrusts him back into the fray, and he\'ll do whatever it takes to protect the innocent. With the balance of good and evil on the line‎, Constantine will use his skills to travel the country, find the supernatural terrors that threaten our world and send them back where they belong. After that, who knows... maybe there\'s hope for him and his soul after all.', 60),
(16, 'Penny Dreadful', 'English', 'Thriller', '2014-05-11', 8, 'Showtime', 'https://static.tvmaze.com/uploads/images/original_untouched/48/122260.jpg', 'Some of literature\'s most terrifying characters, including Dr. Frankenstein and his monster, Dorian Gray, and iconic figures from the novel Dracula are lurking in the darkest corners of Victorian London. They are joined by a core of original characters in a complex, frightening new narrative. Penny Dreadful is a psychological thriller filled with dark mystery and suspense, where personal demons from the past can be stronger than vampires, evil spirits and immortal beasts.', 60),
(17, 'The Amazing Race', 'English', 'Adventure', '2001-09-05', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/508/1271001.jpg', 'From athletes and actors to tattoo artists, social workers and musicians - a diverse mix of teams will need to utilize their street smarts and savvy know-how to compete in the race of their lifetime.', 63),
(18, 'Supernatural', 'English', 'Horror', '2005-09-13', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/445/1114097.jpg', 'This haunting series follows the Winchester brothers as they crisscross the lonely and mysterious back roads of the country in their \'67 Chevy Impala, hunting down every evil supernatural force they encounter along the way.', 60),
(19, 'The Strain', 'English', 'Horror', '2014-07-13', 7, 'FX', 'https://static.tvmaze.com/uploads/images/original_untouched/444/1111710.jpg', 'The Strain is a high-concept thriller that tells the story of Dr. Ephraim Goodweather, the head of the Center for Disease Control Canary Team in New York City. He and his team are called upon to investigate a mysterious viral outbreak with hallmarks of an ancient and evil strain of vampirism. As the strain spreads, Goodweather, his team, and an assembly of everyday New Yorkers wage war for the fate of humanity itself.', 61),
(20, 'The Last Ship', 'English', 'Horror', '2014-06-22', 8, 'TNT', 'https://static.tvmaze.com/uploads/images/original_untouched/164/412464.jpg', 'Their mission is simple: Find a cure. Stop the virus. Save the world. When a global pandemic wipes out eighty percent of the planet\'s population, the crew of a lone and unaffected Navy destroyer, the USS Nathan James, must find a way to pull humanity from the brink of extinction.', 60),
(21, 'True Blood', 'English', 'Horror', '2008-09-07', 8, 'HBO', 'https://static.tvmaze.com/uploads/images/original_untouched/410/1026956.jpg', 'True Blood is a horror/drama based on a series of novels called The Southern American Vampires Mysteries. It focuses on Sookie Stackhouse and her various encounters with vampires and other supernatural beings. The show is centred in the small town of Bon Temps in Louisiana. The show focuses heavily on the co-existence of humans with vampires. The show also touches on several other controversial issues involving equal rights, violence, discrimination and religion.', 60),
(22, 'Once Upon a Time in Wonderland', 'English', 'Horror', '2013-10-10', 7, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/73/183661.jpg', 'In Victorian England, the young and beautiful Alice tells a tale of a strange new land that exists on the other side of a rabbit hole. An invisible cat, a hookah smoking caterpillar and playing-cards that talk are just some of the fantastic things she\'s seen during this impossible adventure. Surely this troubled girl must be insane, and her doctors aim to cure her with a treatment that will make her forget everything. Alice seems ready to put it all behind her, especially the painful memory of the genie she fell in love with and lost forever -- the handsome and mysterious Cyrus . But deep down Alice knows this world is real, and just in the nick of time the sardonic Knave of Hearts and the irrepressible White Rabbit arrive to save her from a doomed fate. Together the trio will take a tumble down the rabbit hole to this Wonderland where nothing is impossible.', 60),
(23, 'Hawaii Five-0', 'English', 'Horror', '2010-09-20', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/213/532575.jpg', 'Hawaii Five-0 is a contemporary take on the classic series about a new elite federalized task force whose mission is to wipe out the crime that washes up on the Islands\' sun-drenched beaches. Detective Steve McGarrett, a decorated Naval officer-turned-cop, returned to Oahu to investigate his father\'s murder and stayed after Hawaii\'s former governor persuaded him to head up the new team: his rules, no red tape and full blanket authority to hunt down the biggest \"game\" in town. Joining McGarrett is Detective Danny \"Danno\" Williams, a relocated ex-New Jersey cop - a working man in paradise who prefers skyscrapers to the coastline - but who\'s committed to keeping the Islands safe for his young daughter; Chin Ho Kelly, an ex-Honolulu police detective and former protégé of McGarrett\'s father who was wrongly accused of corruption; Dr. Max Bergman, the quirky coroner; Chin\'s cousin, Kono Kalakaua, a beautiful and fearless native; and Captain Lou Grover, who formerly headed Hawaii\'s SWAT unit. Joining them is Jerry Ortega, a former classmate of Chin\'s and the Island\'s local conspiracy theorist. The state\'s brash FIVE-0 unit, who may spar and jest among themselves, remain determined to eliminate the seedy elements from the 50th state.', 60),
(24, 'Hellsing', 'Japanese', 'Anime', '2001-10-10', 7, 'Fuji TV', 'https://static.tvmaze.com/uploads/images/original_untouched/178/446544.jpg', 'Hellsing is a 13-part anime based on the manga of the same name. The plot is significantly difficult to that of the the manga although the characters are the same. The show mainly focuses on the hellsing institute that houses the anti-hero named Alucard who swore loyalty to the Helsing family many years before. Alucard being the first ever vampire takes on a new apprentice named Sera\'s.', 30),
(25, 'Hellsing Ultimate', 'Japanese', 'Horror', '2006-02-10', 8, 'TBS', 'https://static.tvmaze.com/uploads/images/original_untouched/178/446780.jpg', 'Hellsing Ultimate, unlike the 13-part Hellsing series, follows the manga of the same name very closely. Alucard being the main protagonist and anti-hero/vampire. Hellsing Ultimate is a 10-part series of OVAs whereby Alucard turns Sera\'s into a vampire. The main focus of the plot being on an enemy neo-nazi group.', 50),
(26, 'Berserk', 'Japanese', 'Anime', '1997-10-07', 8, 'NTV', 'https://static.tvmaze.com/uploads/images/original_untouched/396/991619.jpg', 'Berserk is a 25-part anime set in a dark fantasy/horror environment whereby the series focuses on the main character guts; a lone swordman who later meets up with a group of mercenaries called the band of the hawk. The leader of this band holds a strange necklace called a behelit that will only lead to evil.', 25),
(27, 'Californication', 'English', 'Horror', '2007-08-13', 8, 'Showtime', 'https://static.tvmaze.com/uploads/images/original_untouched/38/95017.jpg', 'Californication is a series based around the writer Hank Moody. He moves to California and suffers a writers block as well as many other family and personal issues. His drinking and generally unhealthy lifestyle interrupts his relationships with his long term lover Karen and his daughter Becca as he struggles with his manager Charlie Runkle.', 30),
(28, 'Vikings', 'English', 'Horror', '2013-03-03', 9, 'History', 'https://static.tvmaze.com/uploads/images/original_untouched/286/715906.jpg', 'Vikings transports us to the brutal and mysterious world of Ragnar Lothbrok, a Viking warrior and farmer who yearns to explore - and raid - the distant shores across the ocean.', 60),
(29, 'American Horror Story', 'English', 'Horror', '2011-10-05', 8, 'FX', 'https://static.tvmaze.com/uploads/images/original_untouched/473/1183640.jpg', 'American Horror Story is an horror television anthology series. Each season is conceived as a self-contained miniseries, following a disparate set of characters and settings, and a storyline with its own beginning, middle, and end. While some actors appear for more than one year, they play completely different roles in each season.', 61),
(30, 'Marvel\'s Agents of S.H.I.E.L.D.', 'English', 'Adventure', '2013-09-24', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/486/1215694.jpg', 'Phil Coulson heads an elite team of fellow agents with the worldwide law-enforcement organization known as S.H.I.E.L.D. (Strategic Homeland Intervention Enforcement and Logistics Division), as they investigate strange occurrences around the globe. Its members -- each of whom brings a specialty to the group -- work with Coulson to protect those who cannot protect themselves from extraordinary and inconceivable threats.', 60),
(31, 'Fargo', 'English', 'Horror', '2014-04-15', 9, 'FX', 'https://static.tvmaze.com/uploads/images/original_untouched/487/1219631.jpg', 'Fargo is a seasonal anthology crime drama with some dark comical elements, inspired by the film Fargo written by the Coen brothers. Each season follows a new case and new characters, all entrenched in the trademark humor, murder and \"Minnesota nice\" that has made the film an enduring classic.', 67),
(32, 'Hemlock Grove', 'English', 'Horror', '2013-04-19', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/0/305.jpg', 'Secrets are just a part of daily life in the small Pennsylvania town of Hemlock Grove, where the darkest evils hide in plain sight.', 52),
(33, 'Helix', 'English', 'Horror', '2014-01-10', 7, 'Syfy', 'https://static.tvmaze.com/uploads/images/original_untouched/126/316697.jpg', 'Helix is a science fiction thriller that focuses on a CDC expedition into the arctic. They go there to investigate the potential outbreak of a disease with no idea what they are getting themselves into. They encounter an almost zombie-like threat that could threaten mankind itself whilst the operator of the facility seems to know more than what he is saying.', 60),
(34, 'The Killing', 'English', 'Horror', '2011-04-03', 8, 'AMC', 'https://static.tvmaze.com/uploads/images/original_untouched/216/540157.jpg', 'The Killing follows Seattle homicide detectives Stephen Holder and Sarah Linden and their work as detectives investigating murders. Sarah Linden takes cases very seriously and has issues keeping her work and family separate, as she pairs up with recovering addict Stephen Holder to solve dark murders.', 60),
(35, 'Intruders', 'English', 'Horror', '2014-08-23', 7, 'BBC America', 'https://static.tvmaze.com/uploads/images/original_untouched/126/316698.jpg', 'A contemporary, chilling, paranormal tale set in the moody Pacific Northwest, the series spins a fascinating and complex web of drama. As strange, apparently unrelated events start happening, multiple story-lines - a missing wife, an assassin covering his crimes, a child on the run - begin to intertwine to reveal a conspiracy that will forever change our understanding of human nature.', 60),
(36, 'Z Nation', 'English', 'Adventure', '2014-09-12', 7, 'Syfy', 'https://static.tvmaze.com/uploads/images/original_untouched/170/426759.jpg', 'Z Nation starts three years after the zombie virus has gutted the country, a team of everyday heroes must transport the only known survivor of the plague from New York to California, where the last functioning viral lab waits for his blood. Although the antibodies he carries are the world\'s last, best hope for a vaccine, he hides a dark secret that threatens them all. With humankind\'s survival at stake, the ragtag band embarks on a journey of survival across three thousand miles of rusted-out post-apocalyptic America.', 61),
(37, 'Resurrection', 'English', 'Horror', '2014-03-09', 7, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/350.jpg', 'The people of Arcadia, Missouri are forever changed when their deceased loved ones suddenly start to reappear. An 8-year-old American boy wakes up alone in a rice paddy in a rural Chinese province with no idea how he got there. Details start to emerge when the boy, who calls himself Jacob, recalls that his hometown is Arcadia, and an Immigration agent, J. Martin Bellamy, takes him there. The home he claims as his own is occupied by a 60-year-old couple, Henry and Lucille Langston, who lost their son, Jacob, more than 30 years ago. While they look different, young Jacob recognizes them as his parents. Lucille is overjoyed at the seeming miracle of her son\'s reappearance. Henry is reluctant to accept that Jacob is back. Those closest to the family want answers, including Sheriff Fred Langston, whose wife Barbara drowned 30 years ago while trying to save Jacob, and Fred\'s daughter, Maggie, a local doctor. Pastor Tom Hale seeks a spiritual reason for what\'s happening in his community. When things take an even more shocking turn, Maggie\'s life-long friend, Elaine Richards, finds herself drawn into Arcadia\'s growing mystery. Bellamy, an outsider in the town, joins forces with Maggie to figure out why the unexplainable is happening in Arcadia. As their investigation plays out, Maggie learns some unsettling truths about her own past. Will they be able to solve the mystery of Arcadia before the rest of the world catches on to events there? And will they be able to protect Jacob from forces beyond their control?', 60),
(38, 'Death Note', 'Japanese', 'Crime', '2006-10-03', 9, 'NTV', 'https://static.tvmaze.com/uploads/images/original_untouched/499/1249019.jpg', 'Death Note is an anime series based around a manga of the same name whereby a human finds a death god\'s notebook. Any person\'s name written in this notebook will die. The main character who finds this noteboook is Light Yagami who faces off against an unfaced character named L who tries to challenge him.', 30),
(39, 'Last Man Standing', 'English', 'Fantasy', '2011-10-11', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/419/1049994.jpg', 'Last Man Standing follows Mike Baxter, a married father of three girls, who tries to maintain his manliness, despite being surrounded by women.', 30),
(40, 'Sleepy Hollow', 'English', 'Crime', '2013-09-16', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/81/204166.jpg', 'Sleepy Hollow is a thrilling mystery-adventure drama series spanning two and a half centuries, in which a resurrected Ichabod Crane pairs up with a present-day police lieutenant to save the enigmatic town of Sleepy Hollow--and the world--from unprecedented evil.', 60),
(41, 'Outlander', 'English', 'Adventure', '2014-08-09', 8, 'STARZ', 'https://static.tvmaze.com/uploads/images/original_untouched/464/1161242.jpg', 'Outlander follows the story of Claire Randall, a married combat nurse from 1945 who is mysteriously swept back in time to 1743, where she is immediately thrown into an unknown world where her life is threatened. When she is forced to marry Jamie, a chivalrous and romantic young Scottish warrior, a passionate affair is ignited that tears Claire\'s heart between two vastly different men in two irreconcilable lives.The Outlander series, adapted from Diana Gabaldon\'s international best-selling books, spans the genres of romance, science fiction, history and adventure into one epic tale.', 61),
(42, 'Scorpion', 'English', 'Crime', '2014-09-22', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/128/322484.jpg', 'Scorpion, inspired by a true story, is a high-octane drama about eccentric genius Walter O\'Brien and his team of brilliant misfits who comprise the last line of defense against complex, high-tech threats of the modern age. As Homeland Security\'s new think tank, O\'Brien\'s \"Scorpion\" team includes Toby Curtis an expert behaviorist who can read anyone; Happy Quinn, a mechanical prodigy; and Sylvester Dodd, a statistics guru. Pooling their extensive technological knowledge to solve mind-boggling predicaments amazes federal agent Cabe Gallo, who shares a harrowing history with O\'Brien. However, while this socially awkward group is comfortable with each other\'s humor and quirks, life outside their circle confounds them, so they rely on Paige Dineen, who has a young, gifted son, to translate the world for them. At last, these nerdy masterminds have found the perfect job: a place where they can apply their exceptional brainpower to solve the nation\'s crises, while also helping each other learn how to fit in.', 60),
(43, 'NCIS: New Orleans', 'English', 'Crime', '2014-09-23', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/280/701985.jpg', 'NCIS: New Orleans is a drama about the local field office that investigates criminal cases involving military personnel in The Big Easy, a city known for its music, entertainment and decadence. Leading the team is Special Agent Dwayne Pride, a.k.a. \"King,\" a native of New Orleans who is driven by his need to do what is right. Working with Pride is Special Agent Christopher LaSalle, who plays hard but works harder and former ATF agent Sonja Percy, who is still adjusting to the team after years of solo undercover assignments. Supporting them is coroner Dr. Loretta Wade, who is as eccentric as she is smart; her brilliant, quirky Forensic Scientist, Sebastian Lund; and Investigative Computer Specialist Patton Plame, an animated and talented hacker. New to the team is Special Agent Tammy Gregorio, a tough, acerbic FBI agent with a mysterious past in New Orleans, who is sent from D.C. to investigate the NCIS team, but also work with Pride when high-risk cases threaten the city. This colorful city that harbors a dark side is a magnet for service personnel on leave, and when overindulgence is followed by trouble, Pride\'s team is at its best', 60),
(44, 'Forever', 'English', 'Crime', '2014-09-22', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/383.jpg', 'Doctor Henry Morgan, New York City\'s star medical examiner, has a secret. He doesn\'t just study the dead to solve criminal cases, he does it to solve the mystery that has eluded him for 200 years - the answer to his own inexplicable immortality. This long life has given Henry remarkable observation skills which impresses his new partner, Detective Jo Martinez. Each week, a new case and their budding friendship will reveal layers of Henry\'s long and colorful past. Only his best friend and confidant, Abe knows Henry\'s secret.', 60),
(45, 'Witches of East End', 'English', 'Crime', '2013-10-06', 8, 'Lifetime', 'https://static.tvmaze.com/uploads/images/original_untouched/0/392.jpg', 'Based on Melissa de la Cruz\'s best-selling novel, Witches of East End centers on the mysterious Beauchamp family who live in the secluded seaside town of East End. Free-spirited artist Joanna Beauchamp is the mother of wild-child bartender Freya and shy librarian Ingrid, who are both gifted -- and cursed -- with a magic birthright, of which they are unaware. Freya notices bizarre occurrences in her life when she inexplicably finds herself drawn to the troubled brother of her wealthy fiance. But it isn\'t until Joanna\'s estranged sister appears with a warning that could change the family\'s fate that the matriarch must reveal to her daughters that they are immortal witches with untapped powers, a revelation that turns their small-town life upside down.', 60),
(46, 'Madam Secretary', 'English', 'Crime', '2014-09-21', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/214/536175.jpg', 'Madam Secretary follows Elizabeth McCord, the shrewd, determined, newly appointed Secretary of State who drives international diplomacy, battles office politics and circumvents protocol as she negotiates global and domestic issues, both at the White House and at home. A college professor and a brilliant former CIA analyst who left for ethical reasons, Elizabeth returns to public life at the request of the President following the suspicious death of her predecessor. The President values her apolitical leanings, her deep knowledge of the Middle East, her flair for languages and her ability to not just think outside the box, but to not even acknowledge there is a box.', 60),
(47, 'Brooklyn Nine-Nine', 'English', 'Fantasy', '2013-09-17', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/402/1007484.jpg', 'Brooklyn Nine-Nine is an ensemble comedy about a talented-but-carefree detective, a by-the-book police captain and their precinct colleagues. While based in the workplace, Brooklyn Nine-Nine is not really about the job – it\'s about the men and women behind the badge.', 30),
(48, 'The Lottery', 'English', 'Crime', '2014-07-20', 7, 'Lifetime', 'https://static.tvmaze.com/uploads/images/original_untouched/146/366444.jpg', 'Set within a dystopian future driven by a global fertility crisis, The Lottery reveals a world staring down the barrel of impending extinction as women have mysteriously stopped bearing children. After years of research, Dr. Alison Lennon and her team remarkably fertilize 100 embryos. However, her victory is short-lived when the Director of the U.S. Fertility Commission, Darius Hayes, takes government control of the lab and informs the President of the monumental scientific breakthrough. To determine which women will carry the prized embryos to term, Chief of Staff Vanessa Keller convinces the President to hold a national lottery and a battle over the control of the 100 embryos begins.', 60),
(49, 'The Knick', 'English', 'Crime', '2014-08-08', 8, 'Cinemax', 'https://static.tvmaze.com/uploads/images/original_untouched/0/417.jpg', 'New York City, 1900: The Knickerbocker Hospital is home to groundbreaking surgeons, nurses and staff who push the boundaries of medicine in a time of astonishingly high mortality rates and zero antibiotics. The newly appointed leader of the surgery staff is the brilliant, arrogant renegade Dr. John Thackery, whose addiction to cocaine and opium is trumped only by his ambition for medical discovery and renown among his peers. Into the all-white staff and patient hospital comes the equally gifted Harvard graduate Dr. Algernon Edwards, who must fight for respect while trying to navigate the racially charged city. Trying to maintain its reputation for quality care while realizing a profit, the Knickerbocker makes an effort to attract wealthy clientele, while literally struggling to keep the lights on.', 60),
(50, 'How to Get Away with Murder', 'English', 'Crime', '2014-09-25', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/212/531512.jpg', 'The brilliant, charismatic and seductive Professor Annalise Keating gets entangled with four law students from her class, How to Get Away with Murder. Little do they know that they will have to apply what they learned to real life, in this masterful, sexy, suspense-driven legal thriller.', 60),
(51, 'Nashville', 'English', 'Crime', '2012-10-10', 7, 'CMT', 'https://static.tvmaze.com/uploads/images/original_untouched/89/224913.jpg', 'Nashville is set against the backdrop of the city\'s music scene and follows Rayna Jaymes and Juliette Barnes. Both women face personal and professional challenges as they navigate their paths as artists and individuals. Surrounding them, and often complicating their lives, are their family, friends and, in some cases, lovers, as well as the up-and-coming performers and songwriters trying to get ahead in the business. Music City can mean so many things to different people. In Nashville, musicians and songwriters are at the heart of the storm driven by their own ambitions. Some are fueled by their creativity and passion for fame. Others struggle to cope with the pressures of success and are doing everything in their power to stay on top.', 60),
(52, 'Legends', 'English', 'Crime', '2014-08-13', 8, 'TNT', 'https://static.tvmaze.com/uploads/images/original_untouched/36/92018.jpg', 'Sean Bean stars in Legends, a suspense-filled drama based on the award-winning book by master spy novelist Robert Littell. Bean plays Martin Odum, an undercover agent working for the FBI\'s Deep Cover Operations (DCO) division. Martin has the uncanny ability to transform himself into a completely different person for each job. But he begins to question his own identity when a mysterious stranger suggests that Martin isn\'t the man he believes himself to be.', 60),
(53, 'Red Band Society', 'English', 'Crime', '2014-09-17', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/0/441.jpg', 'What if a hospital was your high school, boarding school and summer camp rolled into one? What if it was the place where you fell in love for the first time and made friendships that lasted a lifetime? And what if it was all weirdly hilarious and the most fun you ever had in your entire life? This is the world of Red Band Society.', 60),
(54, 'Chicago P.D.', 'English', 'Crime', '2014-01-08', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/513/1282961.jpg', 'District 21 of the Chicago Police Department is made up of two distinctly different groups. There are the uniformed cops who patrol the beat and go head to head with the city\'s street crimes. And there\'s the Intelligence Unit, the team that combats the city\'s major offenses - organized crime, drug trafficking, high profile murders and beyond. These are their stories.', 60),
(55, 'black-ish', 'English', 'Fantasy', '2014-09-24', 6, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/388/970329.jpg', 'Andre \'Dre\' Johnson has a great job, a beautiful wife, Rainbow, four kids, and a colonial home in the \'burbs. But has success brought too much assimilation for this black family? With a little help from his dad, Dre sets out to establish a sense of cultural identity for his family that honors their past while embracing the future.', 30),
(56, 'New Girl', 'English', 'Fantasy', '2011-09-20', 7, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/481/1202650.jpg', 'New Girl is a single-camera ensemble comedy starring Zooey Deschanel as Jess, an offbeat girl who - after a bad breakup - moves in with three single guys and essentially sets a bomb off in their lives.', 30),
(57, 'Chicago Fire', 'English', 'Animation', '2012-10-10', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/513/1282956.jpg', 'No job is more stressful, dangerous or exhilarating than those of the Firefighters, Rescue Squad and Paramedics of Chicago Firehouse 51. These are the courageous men and women who forge headfirst into danger when everyone else is running the other way and whose actions make the difference between life and death. These are their stories.', 60),
(58, 'NCIS', 'English', 'Animation', '2003-09-23', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/501/1254413.jpg', 'NCIS (Naval Criminal Investigative Service) is more than just an action drama. With liberal doses of humor, it\'s a show that focuses on the sometimes complex and always amusing dynamics of a team forced to work together in high-stress situations. Leroy Jethro Gibbs, a former Marine gunnery sergeant, whose skills as an investigator are unmatched, leads this troupe of colorful personalities. Rounding out the team are Anthony DiNozzo, an ex-homicide detective whose instincts in the field are unparalleled and whose quick wit and humorous take on life make him a team favorite; the youthful and energetic forensic specialist Abby Sciuto, a talented scientist whose sharp mind matches her Goth style and eclectic tastes; Caitlin Todd, an ex-Secret Service Agent; and Timothy McGee, an MIT graduate whose brilliance with computers far overshadows his insecurities in the field; Assisting the team is medical examiner Dr. Donald \"Ducky\" Mallard, who knows it all because he\'s seen it all, and he\'s not afraid to let you know. From murder and espionage to terrorism and stolen submarines, these special agents travel the globe to investigate all crimes with Navy or Marine Corps ties.', 60),
(59, 'Orphan Black', 'English', 'Animation', '2013-03-30', 9, 'CTV Sci-Fi Channel', 'https://static.tvmaze.com/uploads/images/original_untouched/484/1210257.jpg', 'Orphan Black is about Sarah, an outsider and orphan whose life changes dramatically after witnessing the suicide of a woman, \"Beth\", who looks just like her. Sarah takes her identity, her boyfriend and her money. But instead of solving her problems, the street-smart chameleon is thrust headlong into a kaleidoscopic mystery. She makes the dizzying discovery that she and the dead woman are clones... but are they the only ones? Sarah quickly finds herself caught in the middle of a deadly conspiracy, racing to find answers.', 60),
(60, 'The Originals', 'English', 'Family', '2013-10-03', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/156/391233.jpg', 'The Originals is a spin-off show from the supernatural drama The Vampire Diaries. It is based in the city of New Orleans where the originals represent the original vampires. The show is primarily based around conflict between vampires, werewolves and witches in the city.', 60),
(61, 'The Vampire Diaries', 'English', 'Family', '2009-09-10', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/88/220908.jpg', 'The Vampire Diaries is a supernatural drama/romance based around Elena Gilbert who falls in love with a 163 year old vampire.Based on a novel series by L.J. Smith.', 60),
(62, 'Utopia', 'English', 'Family', '2013-01-15', 8, 'Channel 4', 'https://static.tvmaze.com/uploads/images/original_untouched/275/688620.jpg', 'Utopia based initially around a small group of people who find a rare manuscript of the same name. This leads the group to be targeted by a large organisation with little knowledge of the manuscript\'s relevance or importance.', 60),
(63, 'Bones', 'English', 'Family', '2005-09-13', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/80/201197.jpg', 'F.B.I. Agent Seeley Booth is teamed up with forensic anthropologist Dr. Temperance \"Bones\" Brennan to solve some of the most baffling and bizarre crimes ever. Booth depends on clues from the living, witnesses and suspects, while Brennan gathers evidence from the dead, relying on her uncanny ability to read clues left behind in the bones of the victims.', 60),
(64, 'The Big Bang Theory', 'English', 'Fantasy', '2007-09-24', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/173/433868.jpg', 'The Big Bang Theory is a comedy about brilliant physicists, Leonard and Sheldon, who are the kind of \"beautiful minds\" that understand how the universe works. But none of that genius helps them interact with people, especially women. All this begins to change when a free-spirited beauty named Penny moves in next door. Sheldon, Leonard\'s roommate, is quite content spending his nights playing Klingon Boggle with their socially dysfunctional friends, fellow Cal Tech scientists Wolowitz and Koothrappali. However, Leonard sees in Penny a whole new universe of possibilities... including love.', 30),
(65, 'Grey\'s Anatomy', 'English', 'Family', '2005-03-27', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/513/1283058.jpg', 'The doctors of Grey Sloan Memorial Hospital deal with life-or-death consequences on a daily basis -- it\'s in one another that they find comfort, friendship and, at times, more than friendship. Together they\'re discovering that neither medicine nor relationships can be defined in black and white. Real life only comes in shades of grey.', 60),
(66, 'Castle', 'English', 'Family', '2009-03-09', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/13/34761.jpg', 'Castle follows Rick Castle who is one of the world\'s most successful crime authors. But when his rock star lifestyle isn\'t enough, this bad boy goes looking for new trouble and finds it working with smart, beautiful Detective Kate Beckett. Inspired by her professional record and intrigued by her buttoned-up personality, Castle\'s found the model for his bold new character whether she likes it or not. Now with the mayor\'s permission, Castle is helping solve crime with his own twist.', 60),
(67, 'The Blacklist', 'English', 'Family', '2013-09-23', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/445/1113538.jpg', 'The Blacklist is a crime drama involving a former government agent who turned into a high-profile criminal turning himself in to the FBI offering to help catch criminals.', 60),
(68, 'The Voice', 'English', 'Music', '2011-04-26', 6, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/505/1263711.jpg', 'The Voice is a reality singing competition show where the idea is to find new singing talent via a series of auditions.', 96),
(69, 'Dancing with the Stars', 'English', 'Family', '2005-06-01', 6, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/477/1194802.jpg', 'The hit series in which celebrities perform choreographed dance routines that are judged by a panel of renowned ballroom experts', 119),
(70, 'NCIS: Los Angeles', 'English', 'Family', '2009-09-22', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/444/1110924.jpg', 'NCIS: Los Angeles is a drama about the high-stakes world of a division of NCIS that is charged with apprehending dangerous and elusive criminals that pose a threat to the nation\'s security. By assuming false identities and utilizing the most advanced technology, this team of highly-trained agents goes deep undercover, putting their lives on the line in the field to bring down their targets.', 60),
(71, 'The Walking Dead', 'English', 'Family', '2010-10-31', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/424/1061900.jpg', 'The Walking Dead tells the story of the months and years that follow after a zombie apocalypse. It follows a group of survivors, led by former police officer Rick Grimes, who travel in search of a safe and secure home. As the world overrun by the dead takes its toll on the survivors, their interpersonal conflicts present a greater danger to their continuing survival than the walkers that roam the country. Over time, the characters are changed by the constant exposure to death and some grow willing to do anything to survive.Based on the comic book series of the same name by Robert Kirkman, Tony Moore, and Charlie Adlard.', 62),
(72, 'Hell on Wheels', 'English', 'Family', '2011-11-06', 8, 'AMC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/526.jpg', 'Hell on Wheels is an American Western television series about the construction of the First Transcontinental Railroad across the United States. The series follows the Union Pacific Railroad and its surveyors, laborers, prostitutes, mercenaries, and others who lived, worked and died in the mobile encampment called \"Hell on Wheels\" that followed the railhead west across the Great Plains. In particular, the story focuses on Cullen Bohannon, a former Confederate soldier who, while working as foreman and chief engineer on the railroad, initially attempts to track down the Union soldiers who murdered his wife and young son during the American Civil War.', 60),
(73, 'The Mindy Project', 'English', 'Fantasy', '2012-09-25', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/485/1213297.jpg', 'The Mindy Project is a single-camera comedy series which follows a skilled OB/GYN navigating the tricky waters of both her personal and professional life.', 30),
(74, 'Sons of Anarchy', 'English', 'Family', '2008-09-03', 8, 'FX', 'https://static.tvmaze.com/uploads/images/original_untouched/495/1239905.jpg', 'Sons of Anarchy is an American television drama series created by Kurt Sutter, about the lives of a close-knit outlaw motorcycle club operating in Charming, a fictional town in California\'s Central Valley. The show centers on protagonist Jackson \"Jax\" Teller (Charlie Hunnam), initially the vice president of the club, who begins questioning the club and himself.', 60),
(75, 'The Middle', 'English', 'Fantasy', '2009-09-30', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/562.jpg', 'Forget about athletes, movie stars and politicians. Parents are the real heroes - but we think Frankie Heck, must be some kind of superhero. A loving wife and mother of three, she\'s middle class in the middle of the country and is rapidly approaching middle age.Frankie and her husband, Mike, have lived in Orson, Indiana, their whole lives. A man of few words (every one a zinger), Mike is a manager at the town quarry and Frankie is the third-best used car salesman (out of the three) at the local dealership. She may not be a high-powered career woman, but when it comes to her family, she\'ll go to just about any length. And with kids like these, she had better. There\'s Axl, her semi-nudist teenage son conceived while under the influence of Guns N\' Roses; Sue, the awkward teenage daughter who fails at everything... but with the utmost of gusto; and their seven-year-old son Brick, whose best friend is his backpack.Sometimes it seems like everyone is trying to get to the top, or struggling not to hit bottom, but we think Frankie and her family will find a lot of love, and a lot of laughs, somewhere in The Middle.', 30),
(76, 'The Mysteries of Laura', 'English', 'Fantasy', '2014-09-17', 7, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/568.jpg', 'Laura Diamond is a brilliant NYPD homicide detective who balances her \"Columbo\" day job with a crazy family life that includes two unruly twin boys and a soon-to-be ex-husband - also a cop - who just can\'t seem to sign the divorce papers. Between cleaning up after her boys and cleaning up the streets, she\'d be the first to admit she has her \"hot mess\" moments in this hilariously authentic look at what it really means to be a working mom today. Somehow, she makes it all work with the help of her sexy and understanding partner, and things becomes even more complicated when her husband becomes her boss at the precinct. For Laura, every day is a high-wire balancing act.', 60),
(77, 'The Goldbergs', 'English', 'Fantasy', '2013-09-24', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/442/1105185.jpg', 'Before there were parenting blogs, trophies for showing up and peanut allergies, there was a simpler time called the \'80s. For geeky and movie obsessed youngest child Adam, these were his wonder years, and he faced them armed with a video camera to capture all the crazy. The Goldbergs are a loving family like any other -- just with a lot more yelling. Mom Beverly is a classic \"smother,\" an overbearing, overprotective matriarch who loves her delicious kids, but still rules this brood with 100% authority and zero sense of boundaries. Dad Murray is gruff and sometimes oblivious, parenting with half his attention span but all his heart. Sister Erica is popular and terrifying, doing her best to cover up that she\'s the smartest of the clan. Barry is a passionate dreamer, who maybe dreams a little too big and who always gets the short end of the stick. Adam is the youngest, a camera-wielding future director who\'s navigating first love, and growing up with his family. Rounding out the family is beloved grandfather Al \"Pops\" Solomon, the wild man of the clan, a shameless Don Juan who\'s learning as much from his family as he teaches them.', 30);
INSERT INTO `CONTENT` (`contentID`, `title`, `language`, `genre`, `releaseDate`, `rating`, `productionStudio`, `image`, `summary`, `runtime`) VALUES
(78, 'Modern Family', 'English', 'Fantasy', '2009-09-23', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/359/898320.jpg', 'Modern Family revolves around three different types of families (nuclear, step- and same-sex) living in the Los Angeles area, who are interrelated through Jay Pritchett and his children, Claire Dunphy (née Pritchett) and Mitchell Pritchett. Patriarch Jay is remarried to a much younger woman, Gloria Delgado Pritchett (née Ramirez), a passionate Colombian with whom he has an infant son, Fulgencio (Joe) Pritchett, and a son from Gloria\'s previous marriage, Manny Delgado.Jay\'s daughter Claire was a homemaker, but has returned to the business world. She is now the chief executive of her father\'s previous business, Pritchett\'s Closets and Blinds. She is married to Phil Dunphy, a realtor and self-professed \"cool dad\". They have three children: Haley Dunphy, a stereotypical ditzy teenage girl; Alex Dunphy, a nerdy, smart middle child; and Luke Dunphy, the off-beat only son.Jay\'s lawyer son Mitchell and his husband Cameron Tucker have one daughter, Lily Tucker-Pritchett. As the name suggests, this family represents a modern-day family, and episodes are comically based on situations which many families encounter in real life.', 30),
(79, 'Criminal Minds', 'English', 'Family', '2005-09-22', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/501/1253961.jpg', 'Criminal Minds revolves around an elite team of FBI profilers who analyze the country\'s most twisted criminal minds, anticipating their next moves before they strike again.', 60),
(80, 'Game of Thrones', 'English', 'Family', '2011-04-17', 9, 'HBO', 'https://static.tvmaze.com/uploads/images/original_untouched/498/1245274.jpg', 'Based on the bestselling book series A Song of Ice and Fire by George R.R. Martin, this sprawling new HBO drama is set in a world where summers span decades and winters can last a lifetime. From the scheming south and the savage eastern lands, to the frozen north and ancient Wall that protects the realm from the mysterious darkness beyond, the powerful families of the Seven Kingdoms are locked in a battle for the Iron Throne. This is a story of duplicity and treachery, nobility and honor, conquest and triumph. In the Game of Thrones, you either win or you die.', 61),
(81, 'The Simpsons', 'English', 'Fantasy', '1989-12-17', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/488/1222067.jpg', 'The Simpsons is the longest running scripted show in US television history. It captures the adventures of Homer, Marge, Maggie, Bart and Lisa who are living in a fictional town called Springfield.', 30),
(82, 'Family Guy', 'English', 'Fantasy', '1999-01-31', 8, 'FOX', 'https://static.tvmaze.com/uploads/images/original_untouched/488/1222068.jpg', 'Family Guy follows Peter Griffin the endearingly ignorant dad, and his hilariously offbeat family of middle-class New Englanders in Quahog, RI. Lois is Peter\'s wife, a stay-at-home mom with no patience for her family\'s antics. Then there are their kids: 18-year-old Meg is an outcast at school and the Griffin family punching bag; 13-year-old Chris is a socially awkward teen who doesn\'t have a clue about the opposite sex; and one-year-old Stewie is a diabolically clever baby whose burgeoning sexuality is very much a work in progress. Rounding out the Griffin household is Brian the family dog and a ladies\' man who is one step away from AA.', 30),
(83, 'Stalker', 'English', 'Crime', '2014-10-01', 7, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/0/647.jpg', 'Stalker is a psychological thriller about detectives who investigate stalking incidents - including voyeurism, cyber harassment and romantic fixation - for the Threat Assessment Unit of the LAPD. Det. Jack Larsen is a recent transfer to the Unit from New York City\'s homicide division, whose confidence, strong personality and questionable behavior has landed him in trouble before - but whose past behavior may also prove valuable in his new job. His boss, Lt. Beth Davis, is strong, focused and an expert in the field, driven by her traumatic personal experience as a victim. With the rest of their team, young but eager Det. Ben Caldwell and deceptively smart Det. Janice Lawrence Larsen and Davis assess the threat level of cases and respond before the stalking and intimidation spirals out of control, all while trying to keep their personal obsessions at bay.', 60),
(85, 'Reign', 'English', 'Family', '2013-10-17', 8, 'The CW', 'https://static.tvmaze.com/uploads/images/original_untouched/81/204119.jpg', 'Hidden between the lines of the history books is the story of Mary Stuart, the young woman the world would come to know as Mary, Queen of Scots. Queen of Scotland since she was six days old, the teenage Mary is already a headstrong monarch - beautiful, passionate, and poised at the very beginning of her tumultuous rise to power. Arriving in France with four close friends as her ladies-in-waiting, Mary has been sent to secure Scotland\'s strategic alliance by formalizing her arranged engagement to the French king\'s dashing son, Prince Francis. But the match isn\'t signed and sealed, it depends more on politics, religion and secret agendas than affairs of the heart. With danger and sexual intrigue around every dark castle corner, Mary rallies her ladies-in-waiting and steels herself, ready to rule the new land and balance the demands of her country and her heart.', 60),
(86, 'Unforgettable', 'English', 'Family', '2011-09-20', 7, 'A&E', 'https://static.tvmaze.com/uploads/images/original_untouched/0/663.jpg', 'Unforgettable follows Carrie Wells, an enigmatic former police detective with a rare condition that makes her memory so flawless that every place, every conversation, every moment of joy and every heartbreak is forever embedded in her mind. It\'s not just that she doesn\'t forget anything - she can\'t; except for one thing: the details that would help solve her sister\'s long-ago murder. Carrie has tried to put her past behind her, but she\'s unexpectedly reunited with her ex-boyfriend and partner, NYPD Detective Al Burns when she consults on a homicide case.', 60),
(87, 'Haven', 'English', 'Family', '2010-07-09', 8, 'Syfy', 'https://static.tvmaze.com/uploads/images/original_untouched/0/672.jpg', 'When FBI Special Agent Audrey Parker is dispatched to the small town of Haven, Maine, on a routine case, she soon finds herself increasingly involved in the return of \"The Troubles\", a plague of supernatural afflictions that have occurred in the town at least twice before. With an openness to the possibility of the paranormal, she also finds a more personal link in Haven that may lead her to the mother she has never known.She and her partner, police detective Nathan Wuornos, find themselves frequently facing problems caused by both the effects of the Troubles, as well as the activities of town folk who take more drastic measures against those who are Troubled.', 60),
(88, 'Bad Judge', 'English', 'Fantasy', '2014-10-02', 7, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/678.jpg', 'No excuses, no apologies, no compromises. Wild child Rebecca Wright knows how to have a good time, but she also happens to be one of L.A.\'s toughest and most respected criminal court judges. She has a reputation for unorthodox behavior in the courtroom, including creative rulings and saying exactly what\'s on her mind. Her private life, on the other hand, is anything but innocent. She parties too much and rocks out on the drums in a band with her best friend, Jenny. While there\'s no shortage of male admirers who would love to spend time with her, she\'s not ready to settle down... except when an 8-year-old boy - whose parents were put in jail by Rebecca - needs her help. He may, in fact, be the one thing that starts to tame this Bad Judge.', 30),
(89, 'A to Z', 'English', 'Fantasy', '2014-10-02', 7, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/679.jpg', 'This is the A to Z story of Andrew and Zelda - a pair that almost wasn\'t - and all that happened from the day they met. Andrew has always been a secret romantic... not above crooning to Celine Dion while driving to work, with dreams of finding \"the one.\" He imagines her to be just like that shimmering beauty he spotted that night in that silver dress at that concert two years ago. Zelda, having grown up with a hippie mom who believed the universe would provide for everything, rebelled into a no-nonsense practical lawyer who prefers the control of online dating. But when a computer glitch sends her a total mismatch, she\'s asked to come in for an interview at the Internet dating site where Andrew works, and this is where it all begins. Andrew and Zelda meet for the first time and despite their differences, sparks fly. She thinks it\'s chance. He thinks it\'s fate. After all, he\'s convinced she\'s the shimmering girl in the silver dress. Is it true love forever or just a detour in destiny?', 30),
(90, 'Parenthood', 'English', 'Family', '2010-03-02', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/685.jpg', 'Parenthood is the critically acclaimed one-hour drama inspired by the box office hit of the same name. This reimagined and updated Universal Television/Imagine Entertainment production follows the trials and tribulations of the very large, colorful and imperfect Braverman family. Sarah Braverman is a single mother with two kids - the bright but rebellious Amber who is living on her own, and sullen and sensitive Drew who returns to Berkeley this year.', 60),
(91, 'Defiance', 'English', 'Adventure', '2013-04-15', 8, 'Syfy', 'https://static.tvmaze.com/uploads/images/original_untouched/0/700.jpg', 'Set on a future Earth, Defiance introduces players and viewers to a world where humans and aliens live together on a planet ravaged by decades of war and transformed by alien terra-forming machines. It centers on Jeb Nolan, the law-keeper in a bustling frontier boomtown that is one of the new world\'s few oasis of civility and inclusion. Nolan is a former Marine who fought in the alien conflict and suffered the loss of his wife and child in the war. The trauma transformed him into a lone wanderer in the wilds of this new and dangerous world.', 62),
(92, 'Falling Skies', 'English', 'Family', '2011-06-19', 8, 'TNT', 'https://static.tvmaze.com/uploads/images/original_untouched/498/1246070.jpg', 'The series tells the story of the aftermath of a global invasion by several races of extraterrestrials that neutralizes the world\'s power grid and technology, quickly destroys the combined militaries of all the world\'s countries, and apparently kills over 90% of the human population within a few days.', 60),
(93, 'Manhattan Love Story', 'English', 'Fantasy', '2014-09-30', 5, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/0/729.jpg', 'Have you ever wondered what your date was thinking? This romantic comedy exposes the differences between men and women through the unfiltered thoughts, and often contradictory actions, of a new couple who have just begun dating.', 30),
(95, 'Scandal', 'English', 'Animation', '2012-04-05', 8, 'ABC', 'https://static.tvmaze.com/uploads/images/original_untouched/303/758518.jpg', 'Everyone has secrets… and Olivia Pope has dedicated her life to protecting and defending the public images of the nation\'s elite by keeping those secrets under wraps. Pope\'s team are at the top of their game when it comes to getting the job done for their clients, but it becomes apparent that these \"gladiators in suits\", who specialize in fixing the lives of other people, have trouble fixing those closest at hand -- their own.', 60),
(97, 'Blue Bloods', 'English', 'Animation', '2010-09-24', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/503/1259385.jpg', 'Blue Bloods is a drama about a multi-generational family of cops dedicated to New York City law enforcement. Frank Reagan is the New York Police Commissioner and heads both the police force and the Reagan brood. He runs his department as diplomatically as he runs his family, even when dealing with the politics that plagued his unapologetically bold father, Henry, during his stint as Chief. A source of pride and concern for Frank is his eldest son Danny, a seasoned detective, family man and Iraq War vet who on occasion uses dubious tactics to solve cases with his loyal and tough partner, Detective Jackie Curatola. The Reagan women in the family include Erin, a N.Y. Assistant D.A., who also serves as the legal compass for her siblings and father, and single parent to her teenage daughter Nicky; and Linda, Danny\'s supportive wife. Jamie is the youngest Reagan, a recent grad of Harvard Law and the family\'s \"golden boy.\" Unable to deny the family tradition, Jamie has decided to give up a lucrative future in law and follow in the family footsteps as a cop.', 60),
(98, 'The Good Wife', 'English', 'Animation', '2009-09-22', 8, 'CBS', 'https://static.tvmaze.com/uploads/images/original_untouched/59/148162.jpg', 'The Good Wife follows Alicia Florrick, a wife and mother who boldly assumes full responsibility for her family and re-enters the workforce after her husband\'s very public sex and political corruption scandal lands him in jail. Pushing aside the betrayal and crushing public humiliation caused by her husband Peter, Alicia starts over by pursuing her original career as a defense attorney.', 60),
(99, 'Boardwalk Empire', 'English', 'Animation', '2010-09-19', 8, 'HBO', 'https://static.tvmaze.com/uploads/images/original_untouched/405/1012589.jpg', 'As the country struggles to cope with the Great Depression and the end of Prohibition looms, Nucky Thompson looks to legitimize himself through alliances with liquor producers, while rivals Lucky Luciano and Meyer Lansky seek to consolidate their power in the wake of Arnold Rothstein\'s death and eliminate all competition - by any means necessary on Boardwalk Empire.', 60),
(100, 'Law & Order: Special Victims Unit', 'English', 'Animation', '1999-09-20', 8, 'NBC', 'https://static.tvmaze.com/uploads/images/original_untouched/500/1250273.jpg', 'In the criminal justice system, sexually-based offenses are considered especially heinous. In New York City, the dedicated detectives who investigate these vicious felonies are members of an elite squad known as the Special Victims Unit. These are their stories.', 60),
(101, 'Iron Man', 'English', 'Adventure', '2008-05-02', 8, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BMTczNTI2ODUwOF5BMl5BanBnXkFtZTcwMTU0NTIzMw@@._V1_SX300.jpg', 'Tony Stark. Genius, billionaire, playboy, philanthropist. Son of legendary inventor and weapons contractor Howard Stark. When Tony Stark is assigned to give a weapons presentation to an Iraqi unit led by Lt. Col. James Rhodes, he\'s given a ride on enemy lines. That ride ends badly when Stark\'s Humvee that he\'s riding in is attacked by enemy combatants. He survives - barely - with a chest full of shrapnel and a car battery attached to his heart. In order to survive he comes up with a way to miniaturize the battery and figures out that the battery can power something else. Thus Iron Man is born. He uses the primitive device to escape from the cave in Iraq. Once back home, he then begins work on perfecting the Iron Man suit. But the man who was put in charge of Stark Industries has plans of his own to take over Tony\'s technology for other matters.', 126),
(102, 'Harry Potter and the Goblet of Fire', 'English', 'Adventure', '2005-11-18', 8, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BMTI1NDMyMjExOF5BMl5BanBnXkFtZTcwOTc4MjQzMQ@@._V1_SX300.jpg', 'Harry\'s (Daniel Radcliffe\'s) fourth year at Hogwarts is about to start and he is enjoying the summer vacation with his friends. They get the tickets to The Quidditch World Cup Final, but after the match is over, people dressed like Lord Voldemort\'s (Ralph Fiennes\') \"Death Eaters\" set a fire to all of the visitors\' tents, coupled with the appearance of Voldemort\'s symbol, the \"Dark Mark\" in the sky, which causes a frenzy across the magical community. That same year, Hogwarts is hosting \"The Triwizard Tournament\", a magical tournament between three well-known schools of magic : Hogwarts, Beauxbatons, and Durmstrang. The contestants have to be above the age of seventeen, and are chosen by a magical object called \"The Goblet of Fire\". On the night of selection, however, the Goblet spews out four names instead of the usual three, with Harry unwittingly being selected as the Fourth Champion. Since the magic cannot be reversed, Harry is forced to go with it and brave three exceedingly difficult tasks.', 157),
(103, 'Iron Man 2', 'English', 'Adventure', '2010-05-07', 7, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BZGVkNDAyM2EtYzYxYy00ZWUxLTgwMjgtY2VmODE5OTk3N2M5XkEyXkFqcGdeQXVyNTgzMDMzMTg@._V1_SX300.jpg', 'With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press, and the public to share his technology with the military. Unwilling to let go of his invention, Stark, along with Pepper Potts, and James \"Rhodey\" Rhodes at his side, must forge new alliances - and confront powerful enemies.', 124),
(104, 'Iron Man 3', 'English', 'Adventure', '2013-05-03', 7, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BMjE5MzcyNjk1M15BMl5BanBnXkFtZTcwMjQ4MjcxOQ@@._V1_SX300.jpg', 'Marvel\'s \"Iron Man 3\" pits brash-but-brilliant industrialist Tony Stark/Iron Man against an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy\'s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man?', 130),
(105, 'Taxi Driver', 'English', 'Crime', '1976-02-09', 8, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BM2M1MmVhNDgtNmI0YS00ZDNmLTkyNjctNTJiYTQ2N2NmYzc2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 'Travis Bickle is an ex-Marine and Vietnam War veteran living in New York City. As he suffers from insomnia, he spends his time working as a taxi driver at night, watching porn movies at seedy cinemas during the day, or thinking about how the world, New York in particular, has deteriorated into a cesspool. He\'s a loner who has strong opinions about what is right and wrong with mankind. For him, the one bright spot in New York humanity is Betsy, a worker on the presidential nomination campaign of Senator Charles Palantine. He becomes obsessed with her. After an incident with her, he believes he has to do whatever he needs to make the world a better place in his opinion. One of his priorities is to be the savior for Iris, a twelve-year-old runaway and prostitute who he believes wants out of the profession and under the thumb of her pimp and lover Matthew.', 114),
(106, 'Monty Python and the Holy Grail', 'English', 'Adventure', '1975-05-25', 8, 'Blue Sky Studios', 'https://m.media-amazon.com/images/M/MV5BN2IyNTE4YzUtZWU0Mi00MGIwLTgyMmQtMzQ4YzQxYWNlYWE2XkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 'History is turned on its comic head when, in tenth-century England, King Arthur travels the countryside to find knights who will join him at the Round Table in Camelot. Gathering up the men is a tale in itself but after a bit of a party at Camelot, many decide to leave only to be stopped by God, who sends them on a quest: to find the Holy Grail. After a series of individual adventures, the knights are reunited but must face a wizard named Tim the Enchanter, killer rabbits and lessons in the use of holy hand grenades. Their quest comes to an end however when the Police intervene - just what you would expect in a Monty Python movie.', 91),
(107, 'Life of Brian', 'English', 'Fantasy', '1979-08-17', 8, 'Metro-Goldwyn-Mayer (MGM)', 'https://m.media-amazon.com/images/M/MV5BMDA1ZWI4ZDItOTRlYi00OTUxLWFlNWQtMzM5NDI0YjA4ZGI2XkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', 'The story of Brian of Nazareth (Graham Chapman), born on the same day as Jesus of Nazareth, who takes a different path in life that leads to the same conclusion. Brian joins a political resistance movement aiming to get the Romans out of Judea. Brian scores a victory of sorts when he manages to paint political slogans on an entire wall in the city of Jerusalem. The movement is not very effective but somehow Brian becomes a prophet and gathers his own following. His fate is sealed however and he lives a very short life.', 94),
(108, 'The Exorcist', 'English', 'Horror', '1973-12-26', 8, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BYWFlZGY2NDktY2ZjOS00ZWNkLTg0ZDAtZDY4MTM1ODU4ZjljXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', 'A visiting actress in Washington, D.C., notices dramatic and dangerous changes in the behavior and physical make-up of her 12-year-old daughter. Meanwhile, a young priest at nearby Georgetown University begins to doubt his faith while dealing with his mother\'s terminal sickness. And, book-ending the story, a frail, elderly priest recognizes the necessity for a show-down with an old demonic enemy.', 122),
(109, 'Dirty Harry', 'English', 'Adventure', '1971-12-23', 8, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BMzdhMTM2YTItOWU2YS00MTM0LTgyNDYtMDM1OWM3NzkzNTM2XkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 'In 1971, San Francisco faces the terror of a maniac known as the \"Scorpio Killer\" (Andrew Robinson), who snipes at innocent victims and demands ransom through notes left at the scene of the crime. Inspector \"Dirty\" Harry Callahan (Clint Eastwood) is assigned to the case along with his newest partner Inspector Chico Gonzalez (Reni Santoni) to track down Scorpio and stop him. Using humiliation and cat-and-mouse type of games against Callahan, Scorpio is put to the test with the cop with a dirty attitude.', 102),
(110, 'My Fair Lady', 'English', 'Drama', '1964-12-25', 8, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BNGM0ZTU3NmItZmRmMy00YWNjLWEzMWItYzg3MzcwZmM5NjdiXkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_SX300.jpg', 'Pompous phonetics Professor Henry Higgins (Sir Rex Harrison) is so sure of his abilities that he takes it upon himself to transform a Cockney working-class girl into someone who can pass for a cultured member of high society. His subject turns out to be the lovely Eliza Doolittle (Audrey Hepburn), who agrees to speech lessons to improve her job prospects. Higgins and Eliza clash, then form an unlikely bond, one that is threatened by aristocratic suitor Freddy Eynsford-Hill (Jeremy Brett).', 170),
(111, 'The Blue Lagoon', 'English', 'Adventure', '1980-07-02', 6, 'Studio Ghibli', 'https://m.media-amazon.com/images/M/MV5BZWY0OGFkMGQtYzBjOS00MTQyLWI4MmUtMzcyYzkxYzdjOWIwXkEyXkFqcGdeQXVyMTUzMDUzNTI3._V1_SX300.jpg', 'On a journey to San Francisco, Richard, his father and cousin Emmeline find themselves on a ship about to explode. Rushed to a lifeboat with Paddy Button, the two children escape while their father (and uncle) are on another lifeboat. In the chaos following, the lifeboats are separated. Paddy, Richard and Emmeline find themselves with no food and no water stuck in the middle of nowhere. After some time, the three come across an uncharted paradise, where Paddy quickly teaches the children fishing, hunting and building. After maybe a month or two, Paddy gets very drunk off a barrel of rum found on the island when they first arrive, and drowns in the middle of the night. Emmeline and Richard, now alone and very scared, move location and rebuild their island home. Many years later, the two young teenagers have developed a very real home, but hormones and feelings between the two strain their friendship, until Richard, who is still very determined to reach San Francisco, is let down by Emmeline when a ship passes by the island and she does not light the signal fire. Throwing her out of the home they had built together, Emmeline attempts to survive on her own but is hurt. After Richard finds her dying, he realizes how he really feels for her and manages to save her. Nature runs its course and their friendship turns into love as the couple learn about the facts of life, when Emmeline has a baby and does not understand why.', 104),
(112, 'Bonnie and Clyde', 'English', 'Adventure', '1967-08-14', 8, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BMTNjNzBlY2QtNmY1Ni00MzhkLThmODgtMzc3ZDQ0YzJjZjNlXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', '1934. Young adults Bonnie Parker, a waitress, and Clyde Barrow, a criminal just released from prison, are immediately attracted to what the other represents for their life when they meet by chance in West Dallas, Texas. Bonnie is fascinated with Clyde\'s criminal past, and his matter-of-factness and bravado in talking about it. Clyde sees in Bonnie someone sympathetic to his goals. Although attracted to each other physically, a sexual relationship between the two has obstacles. They decide to join forces to embark on a life of crime, holding up whatever establishments, primarily banks, to make money and to have fun. They don\'t plan on hurting anyone or killing despite wielding loaded guns. They amass a small gang of willing accomplices, including C.W. Moss, a mechanic to fix whatever cars they steal which is important especially for their getaways, and Buck Barrow, one of Clyde\'s older brothers. The only reluctant tag-along is Buck\'s nervous wife, Blanche Barrow, a preacher\'s daughter. The gang\'s life changes after the first fatal shot is fired. After that, their willingness to shoot to kill increases to protect themselves and their livelihood. Their notoriety precedes them, so much so that no matter what one\'s opinion is of them, most want to have some association to the Barrow gang, to help them, to be spoken in the same breath as them, or to capture and or kill them. Of the many people they encounter in their crime spree, the one who may have the most profound effect on their lives is Texas Ranger, Frank Hamer, who seeks retribution.', 111),
(113, 'The Professionals', 'English', 'Action', '1966-11-04', 7, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BMTY0OWNiZTQtZGY4MS00YmJlLTg4YzEtMmE3YTVkMDM3ODRlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 'A rich Texan, J.W. Grant, selects three men and invites them to his private train to offer them a contract: Rescue his wife who has been kidnapped by a Mexican revolutionary. The leader of the men, Rico, decides they would be a better team if Grant would hire one more man, an explosives expert. Grant quickly agrees and soon the four are off to complete the contract. However, while on the trail, they discover some interesting facts, like has Mrs. Grant \'really\' been kidnapped?', 117),
(114, 'The Guns of Navarone', 'English', 'Action', '1961-04-28', 7, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BOTk0OGI2YTItZWMzZS00M2M1LWI5N2YtMDE3YmNiY2FlZTk1XkEyXkFqcGdeQXVyNTgyNTA4MjM@._V1_SX300.jpg', 'In 1943, the British Navy is not able to rescue 2,000 soldiers trapped in the Island of Kheros since two powerful German cannons on the top of the Navarone Island are sinking the Allied vessels. After a failed aerial attack, the Allied command decide to send a six-man team disguised as fishermen to Navarone to blow-up the guns. The squad is commanded by Maj. Roy Franklin and composed by Capt. Keith Mallory, who is an experienced mountain climber, and his former partner Col. Andrea Stavros; the explosive expert Cpl. John Anthony Miller; the engineer CPO \'Butcher\' Brown; and the Greek assassin Spyros Pappadimos, who was born in Navarone. They sail during the night and after an encounter with a German patrol boat and a storm in the sea, they arrive to Navarone and Capt. Mallory needs to climb a cliff face during a heavy rainy night to proceed their mission. Will they succeed?', 158),
(115, 'Lupin III: The Castle of Cagliostro', 'Japanese', 'Animation', '1979-12-15', 8, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BYzYyNjg3OTctNzA2ZS00NjkzLWE4MmYtZDAzZWQ0NzkyMTJhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'After successfully robbing the Monte Carlo Casino, Lupin The Third and Jigen Daisuke soon learn that their money is in fact counterfeit and they go after the man responsible: Count Lazare de Cagliostro. The two soon find out that the Count is behind something far worse than counterfeiting money for casinos: he has been keeping a family secret hidden deep in his castle. Can Lupin find out what this is and live to tell the tale? With the help of Jigen and the wise samurai Goemon Ishikawa XIII, Lupin is hell-bent on finding out the Cagliostro family\'s secret fortune and make it his own.', 102),
(116, 'Richard Pryor: Live in Concert', 'English', 'Documentary', '1979-01-26', 8, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BMTkxZTIxZGMtMDUxYS00OWIwLWE4YTYtZDE3NDFlZDIyMDlhXkEyXkFqcGdeQXVyNjc5NjEzNA@@._V1_SX300.jpg', 'Richard Pryor\'s classic 1979 concert film has him discussing a wide range of topics, including race, the police and his favorite target -- himself.', 78),
(117, 'The Long Riders', 'English', 'Biography', '1980-05-16', 7, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BZGY1MGUzZjctZTM5OS00NWJmLWE0YzAtNmFhZjA4OTUwZmJjXkEyXkFqcGdeQXVyMTUzMDUzNTI3._V1_SX300.jpg', 'After the American Civil War, outlaw Jesse James forms a gang comprised of himself, his brother Frank James, Cole Younger and his two brothers, Jim Younger and Bob Younger as well as Ed Miller and his brother Clell Miller. The gang is led by Jesse James and Cole Younger. The gang starts by robbing small banks and stagecoaches in the Midwest and in their home state of Missouri. Later, the gang targets bigger prizes, such as larger banks and trains. This criminal activity attracts the attention of the railroad company owners who hire the Pinkerton Detective Agency to capture the gang. When the gang kills a few Pinkerton detectives, a war of sorts starts between the Pinkerton Agency and the James-Younger gang. Sometimes caught in the middle of it are innocent civilians. In 1876, the gang is running out of banks to rob in Missouri and decides to raid a supposedly fat bank, far up North, in the state of Minnesota. But the Pinkerton Detective Agency is setting up a trap there.', 100),
(118, 'White Christmas', 'English', 'Fantasy', '1954-11-05', 8, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BYjI0ZTk0ZjQtZTMzOS00NDdmLTk0YzUtZTQ4NGRkNWFhZTkxXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 'Having left the Army following W.W.II, Bob Wallace and Phil Davis team up to become a top song-and-dance act. Davis plays matchmaker and introduces Wallace to a pair of beautiful sisters (Betty and Judy) who also have a song-and-dance act. When Betty and Judy travel to a Vermont lodge to perform a Christmas show, Wallace and Davis follow, only to find their former commander, General Waverly, as the lodge owner. A series of romantic mix-ups ensue as the performers try to help the General.', 120),
(119, 'Cairo Station', 'Arabic', 'Crime', '1958-01-20', 7, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BZDk3YTU5NjgtNjFiOC00ODk5LTgzNjctOGY1NTU1NTdhZTNiXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg', 'Kinawi, a physically challenged peddler who makes his living selling newspapers in the central Cairo train station, is obsessed by Hannouma, an attractive young woman who sells drinks. While she treats Kinawi in a sympathetic way and jokes with him about a possible relationship, She is actually in love with Abu Sri\', a strong and respected porter at the station who is struggling to unionize his fellow workers to combat their boss\' exploitative and abusive treatment.', 77),
(120, 'Hitler: A Career', 'German', 'Documentary', '1977-07-08', 7, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BOGQ4ZTQ3MmUtMjUwZi00Zjk3LWFiNDQtMTU2ZTE3MzRiMzY1XkEyXkFqcGdeQXVyNjc5NjEzNA@@._V1_SX300.jpg', 'This meticulously assembled film dissects the Third Reich with an analytical blade, charting Hitler\'s improbable rise, his mastery of crowd psychology and his consummate skill in exploiting others\' weaknesses.', 150),
(121, 'FTA', 'English', 'Documentary', '1972-11-22', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BYWNiYjIwNTAtNmY1OS00MmRiLWJlMTktNzZmYzJkY2ZjMGQ3XkEyXkFqcGdeQXVyMjI3NDAyNg@@._V1_SX300.jpg', 'A documentary about a political troupe headed by actors Jane Fonda and Donald Sutherland which traveled to towns near military bases in the US in the early 1970s. The group put on shows called \"F.T.A.\", which stood for \"F**k the Army\", and was aimed at convincing soldiers to voice their opposition to the Vietnam War, which was raging at the time. Various singers, actors and other entertainers performed antiwar songs and skits during the show.', 103),
(122, 'Saladin', 'Arabic', 'Action', '1963-02-25', 7, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BMGMzYzA5Y2MtYzYxNy00YThjLTlkOGMtYWIzMjJmZWVlNzM0XkEyXkFqcGdeQXVyNjUxOTU2ODU@._V1_SX300.jpg', 'Saladin, ruler of the kingdoms surrounding the Latin state of Jerusalem, is brought to attack the Christians in the Holy Land by the sacking of a convoy of Muslim pilgrims, a group which included his sister. In a short campaign against odds, Jerusalem is taken and almost the entire Middle East is in Muslim hands. Crusade is called again in Europe, and the combined forces of the French king, German emperor, and English king form the 3rd Crusade, under the leadership of Richard the Lionheart of England. Although Accre is taken by the Crusaders, Saladin succeeds in preventing the recapture of Jerusalem, and in the end negotiations between himself and Richard (who Saladin admires as the only honorable leader) leave the Holy Land in Moslem hands.', 194),
(123, 'Dark Waters', 'Arabic', 'Drama', '1956-01-16', 7, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BNmUyY2U1MzYtYmIxYi00MzRjLTg4ZjktNzRjYjQwYTlhMzVlXkEyXkFqcGdeQXVyMjg0MzMwNzg@._V1_SX300.jpg', 'After three years of absence, back (Recep) after a long travel trip spent on the back of one of the ships in an effort to save money in order to complete his marriage b (benign), who lives with his mother in a shack built on the sea, but with the passage of days legged in the heart of (Recep) feelings of jealousy when he doubted the existence of a relationship between the pool (benign), and between (Mamdouh) son of the owner of the shipping company, which coincided with the existence of many problems between the owner of the company and its employees.', 120),
(124, 'Alexandria... Why?', 'Arabic', 'Drama', '2021-06-18', 7, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BYjcxZDA3ZjYtNDYyMi00NjYxLTgzNTItYmIzYTNhMjlhZmRmXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg', 'Yehia is a young man living in the cosmopolitan Alexandria during World War II. Inspired by American movies and Shakespeare, he aspires to be an actor, but struggles to pursue his Hollywood dream, given the constraints of his life in the middle class and the horrors of war.', 133),
(125, 'Amrapali', 'Hindi', 'Fantasy', '1966-09-11', 7, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BMGZhNmI2NjEtYzYxOS00NTFjLWFjZTgtY2FhMzRlMGRlZTE2XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'A victory over neighboring state Vaishai has always eluded Magadh Samrat Ajaatshatru despite being winning and taking control over all neighboring states. He attacks Vaishali only get defeated again. Wounded, lost and on the run, Ajaatshatru dons the guise of a Vaishali soldier and takes shelter with a woman named Amrapali and they fall in love with each other. Ajaatshatru finds an ally in Senapati Balbadhra Singh and both start a plot to gain control of Vaishali. Vaishali Samrat comes to know about Ajaatshatru and Amrapali\'s liaison with him, he sentences her with a death penalty. Ajaatshatru is enraged at this, he gathers together his armies and storms the unsuspecting Vaishali and virtually burns the city down, killing almost everyone in it. This accomplished, he rushes to free his beloved from the dungeons. He does set her free but it is not the same Amrapali; this Amrapali is quite different. She is not at all thrilled to be in the presence of her conqueror lover. She teaches him what he won in the battle ground but what he lost in reality.', 119),
(126, 'Friendship', 'Hindi', 'Action', '1980-10-17', 6, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BYmY1ZjIwODItNGVkOS00Zjg4LWE3NmEtOWY0MDAyZDM5YjRiXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Vijay Varma (Amitabh Bachchan) and Ravi Kapoor (Shatrughan Sinha) are two close childhood friends. When they thought they have matured enough they decides to enter law policy: one as a police officer and another as a lawyer. There lives takes a turn when both reaches a woman named Sheetal Sahni (Zeenat Aman) at different places and time respectively. Both fell in love with her and does not relate each others emotion to one another. Then an old enemy of Vijay named Mr. Daaga (Prem Chopra) enters the scene and deploys such a way that will create misunderstandings between the two friends forever.', 152),
(127, 'The Blazing Sun', 'Arabic', 'Crime', '1954-03-01', 7, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BNzdmZmVjNDgtNmVkMy00ZWRkLTgzNWItY2NlN2IxMmEwNDEzXkEyXkFqcGdeQXVyMjI4NzAzNjg@._V1_SX300.jpg', 'The film revolves around a young Ahmed, who works as an agronomist, and who returns to his village in the south of the valley, where his father works as Headmaster cultivation, Vinjeh in improving the reeds strain. Then loves daughter Basha since they were young, but rivaled the Basha secretary who coveted in the marriage of Nadia .. coincided with anger Basha him because he has a monopoly on the export of sugar cane after optimization conducted by him, exploited Basha dispute between Sheikh Homestead and the beholder is called Basha, secretary fire on the beholder and fabricating the charge to Sheikh Homestead and start enmity between Ahmad and Ibn Sheikh Homestead to avenge his father.', 105),
(128, 'Return of the Prodigal Son', 'Arabic', 'Crime', '1976-09-24', 7, 'Studio Ghibli', 'https://m.media-amazon.com/images/M/MV5BODUxYjQ4YjEtZDI5Ni00MDk3LTkzNzYtMTFjZDk1NTA2NTI1XkEyXkFqcGdeQXVyMjA0MzYwMDY@._V1_SX300.jpg', 'Freed after spending 12 years in jail, a man\'s homecoming turns into a dark affair as his disillusion clashes with his family expectations.', 120),
(129, 'Manoranjan', 'Hindi', 'Fantasy', '1974-01-11', 6, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BYzM0MjJjNzItMGRjMy00OGYxLWFjM2MtM2EzZjExNWY1Y2I5XkEyXkFqcGdeQXVyODA3NzU4Njc@._V1_SX300.jpg', 'An upright beat cop, working the most notorious area of the city - the \'red light district\' - desperately tries to hang on to his values in such an amoral environment. He falls for a hooker, and sets out to reform her.', 158),
(130, 'Beyrouth ya Beyrouth', 'Arabic', 'Drama', '2020-10-18', 6, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BY2I0M2QxYWItNjBkNS00YzcxLTkzZmYtYTZmY2Y0ZjRhY2YyXkEyXkFqcGdeQXVyNDM1Mjc2NDY@._V1_SX300.jpg', 'In the aftermath of the 1967 defeat, four young Lebanese try to figure out their places in a society whose rules seem to have changed. It proved to be an extraordinary anticipation of the civil war that would engulf the country while the film was being edited.', 111),
(131, 'We Are All for the Fatherland', 'French', 'Documentary', '2020-10-18', 5, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BNWI5ZGZjMzctYzRkNC00YTg4LWJmOWUtMWUxZjIxYmE5ZmZiXkEyXkFqcGdeQXVyNDM1Mjc2NDY@._V1_SX300.jpg', 'This turned up on Netflix under \"movies from the 1970s\". It\'s a collection of pieces of film without any explanation on the screen of what is being shown. The pieces of film concern a funeral, soldiers or militiamen, tanks moving around, children\'s faces, etc.Without any context or explanation it\'s not clear why the filmmaker shows us these scenes or what we\'re supposed to make of it.', 80),
(132, 'Lal Patthar', 'Hindi', 'Drama', '1971-12-31', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BMTkyNWI5ZmQtNzVlOS00MzkxLWI0ZTktZTEzMjAyZmY2Yzg4XkEyXkFqcGdeQXVyNDQwOTAzNw@@._V1_SX300.jpg', 'Raja Kumar Bahadur alias Gyan Shankar Rai has been a total abstainer all his life, never touching a drop of alcohol, and keeping away from women and all known vices all his life. Then one day he sees a young woman named Saudamani, and instantly falls in love with her. He finds out about her background, and virtually buys her, and brings her to his palatial home. This is when he takes to drinking, and wooing her, and renaming her Madhuri, but refrains from marrying her. Years later, he sees another beautiful woman, about half his age, named Sumita, meets with her parents, pays off their debts, and marries her in the bargain. He brings Sumita home, but makes it clear that Madhuri\'s word is law here. Then Kumar finds out that Sumita had a childhood sweetheart in Shekhar, who has now returned from abroad. Kumar meets with Shekhar and finds out that both still have feelings for each other. An insecure and jealous Kumar now schemes a plot against them on the historical grounds of Fatehpur Sikhri - which houses the tombs of Badshah Akbar\'s Hindu wife, Jodhabai, and Christian wife, Mariam. It is here Kumar\'s plot unfolds to entrap the young lovers, thus giving the title \"Lal Patthar\" (meaning red stones).', 148),
(133, 'Adventures of Ali-Baba and the Forty Thieves', 'Hindi', 'Action', '1980-05-29', 6, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BZjJiMWE4MjAtMTRjNi00ZDFkLTgyNjgtNzc5ZjhmZjg0N2ViXkEyXkFqcGdeQXVyNjA0Mzc0MzI@._V1_SX300.jpg', 'Alibaba, (Dharmendra) a native of Guleba is in love with Marjina (Hema Malini). The town has a ruler, Abu Hasan. Guleban is terrorized by dacoits. Ali Baba hears the password to the door of the cave of the dacoits and takes a lot of jewels from the cave. His brother is killed by the dacoits as he forgets the password and is trapped inside. A young girl whose father has been murdered by the dacoits (Zeenat Aman) has a score to settle with Abu Hasan. Abu Hasan turns out to be the head of the dacoits and he comes to know that Ali Baba visits the cave. He hides the 40 thieves in large urns to kill Ali Baba. Ali Baba comes to know of this and kills them all. He brings to light the startling truth that their own ruler heads the dacoits!', 138),
(134, 'Professor', 'Hindi', 'Fantasy', '1962-05-11', 7, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BMzkzMzk4YzMtY2YzNi00ODQ3LWExZGQtYzhiNzI0NWU4ZDFlXkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_SX300.jpg', 'Sita devi is a very strict aunt for a number of young ladies, and does not allow them to fraternize with males. Along comes Pritam disguised as an elderly Professor Khanna to break every possible rule of the aunt.', 166),
(135, 'Top Gun', 'English', 'Action', '1986-05-16', 7, 'A24', 'https://m.media-amazon.com/images/M/MV5BZjQxYTA3ODItNzgxMy00N2Y2LWJlZGMtMTRlM2JkZjI1ZDhhXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 'Call-sign \"Maverick\", LT Pete Mitchell, the impetuous daredevil Navy-pilot ace, is accepted into Miramar\'s elite Fighter School, also known as \"Top Gun\". There, as the impulsive pilot competes with the best of the best, not only will he meet Charlie, the flying school\'s curvaceous astrophysics instructor, but also the brilliant and highly competitive fellow student, \"Iceman\", with whom right from the start, he will engage in a reckless contest. As Maverick is haunted by his father\'s mysterious death, will he be able to suppress his wild nature to win the prestigious Top Gun Trophy?', 109),
(136, 'Stand by Me', 'English', 'Adventure', '1986-08-22', 8, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BODJmY2Y2OGQtMDg2My00N2Q3LWJmZTUtYTc2ODBjZDVlNDlhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'It\'s the summer of 1959 in Castlerock, Oregon and four 12 year-old boys - Gordie, Chris, Teddy and Vern - are fast friends. After learning of the general location of the body of a local boy who has been missing for several days, they set off into the woods to see it. Along the way, they learn about themselves, the meaning of friendship and the need to stand up for what is right.', 89),
(137, 'Once Upon a Time in America', 'English', 'Crime', '1984-06-01', 8, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BMmQzZjdmZDAtOGE2Yy00MmUwLTljYzgtZTMwMjk3ZDdiOWUyXkEyXkFqcGdeQXVyNjc5NjEzNA@@._V1_SX300.jpg', 'With the vivid memory of his long-gone childhood friends Max, Patsy, and Cockeye etched in his mind, his ferociously loyal partners-in-crime during their rise to prominence in New York\'s Prohibition-era Lower East Side, the defeated, penniless, and guilt-ridden former gangster David \"Noodles\" Aaronson returns to Manhattan. Not knowing what to expect on his mission to shed light on his opaque past, grizzled Noodles reunites with his only living friend Fat Moe after 35 haunted years of self-exile. However, the relentless, piercing sound of culpability stands in the way of finding closure, as the inscrutable content of a well-worn leather suitcase further complicates matters. And now, against the backdrop of a torn conscience, the sad, bittersweet recollections of more than 50 years of love, death, and everything in-between become inextricably intertwined, leading to even more puzzling questions. But what are a man\'s options when he is left with nothing?', 229),
(138, 'When Harry Met Sally...', 'English', 'Fantasy', '1989-07-21', 8, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BMjE0ODEwNjM2NF5BMl5BanBnXkFtZTcwMjU2Mzg3NA@@._V1_SX300.jpg', 'Harry and Sally meet when she gives him a ride to New York after they both graduate from the University of Chicago. The film jumps through their lives as they both search for love, but fail, bumping into each other time and time again. Finally a close friendship blooms between them, and they both like having a friend of the opposite sex. But then they are confronted with the problem: \"Can a man and a woman be friends, without sex getting in the way?\"', 95),
(139, 'Teenage Mutant Ninja Turtles', 'English', 'Action', '1990-03-30', 7, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BNzg3NTQ4NDk5NV5BMl5BanBnXkFtZTgwNzMzNDg4NjE@._V1_SX300.jpg', 'Through contact with a mysterious ooze, four turtles in the sewers of New York mutate into intelligent pizza-loving humanoids, and are mentored in the art of ninja combat by the wise rat Splinter. When the evil Shredder attempts to take over the world, the turtles set out to stop him.', 93),
(140, 'Full Metal Jacket', 'English', 'Drama', '1987-07-10', 8, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BNzkxODk0NjEtYjc4Mi00ZDI0LTgyYjEtYzc1NDkxY2YzYTgyXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 'A two-segment look at the effect of the military mindset and war itself on Vietnam era Marines. The first half follows a group of recruits in boot camp under the command of the punishing Gunnery Sergeant Hartman. The second half shows one of those recruits, Joker, covering the war as a correspondent for Stars and Stripes, focusing on the Tet offensive.', 116),
(141, 'Christine', 'English', 'Horror', '1983-12-09', 7, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BZThhNDQxNzAtOTYzZC00MzZkLWI2YjItOTE2ZjliZDY3NTFkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'In 1957, in Detroit, a red Plymouth Fury is built and is the cause of two accidents, one of them fatal, still in the assembly line. Twenty-one years later, the outcast and bullied nerd Arnold \"Arnie\" Cunningham is getting a ride with his best and only friend Dennis Guilder and he sees the wrecked car for sale in a garden. Arnie immediately falls in love with the car. The car was given the name Christine by its first owner. He brings the car to a repair shop of the despicable Will Darnell and works hard to restore the classic car. While he works in the restoration, he changes his personality to a cocky teenager and he dates the most beautiful girl in the high-school, Leigh Cabot. Soon Arnie becomes selfish and jealous of the supernatural Christine that kills everyone that is a threat to them.', 110),
(142, 'A Nightmare on Elm Street', 'English', 'Horror', '1984-11-16', 7, 'Blue Sky Studios', 'https://m.media-amazon.com/images/M/MV5BNzFjZmM1ODgtMDBkMS00NWFlLTg2YmUtZjc3ZTgxMjE1OTI2L2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 'On Elm Street, Nancy Thompson and a group of her friends (comprising Tina Gray, Rod Lane and Glen Lantz) are being tormented by a clawed killer in their dreams named Fred Krueger. Nancy must think quickly, as Fred tries to pick them off one by one. When he has you in your sleep, who is there to save you?', 91);
INSERT INTO `CONTENT` (`contentID`, `title`, `language`, `genre`, `releaseDate`, `rating`, `productionStudio`, `image`, `summary`, `runtime`) VALUES
(143, 'Awakenings', 'English', 'Biography', '1991-01-11', 8, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BMWUxOTk2NzUtZDBjYi00MzIwLWFlODYtZjFmNDM5MjlkYjJjXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', '1969. Dr. Malcolm Sayer is hired as a clinical physician at a local hospital in the Bronx, despite he only having a research background. The job is not ideal on his side as he has difficulties relating to people which is the reason he has focused on research projects not involving human subjects, while the hospital hires him somewhat out of desperation in not finding anyone else with the qualifications who wants the job. Most of his patients are in a semi-catatonic state and are housed in what some of the orderlies coin the \"garden\" ward, where all they can do for the patients is water and feed them. He notices that some of the patients, despite their generally catatonic state, respond in unusual ways to certain stimuli. In doing some research, he also finds that some common bonds between these patients are that they suffered from encephalitis in the 1920s or 1930s, and that their physical states are like they have Parkinson\'s disease frozen in time. As such, he is able to convince, albeit reluctantly, his skeptical boss, Dr. Kaufman, to administer an expensive experimental drug therapy on only one patient with family consent. That patient is forty-one year old Leonard Lowe, who has been in his current state since he was eleven years old, and who has been supported by his loving mother through all these years. As the drug therapy \"awakens\" Leonard, there are several issues that come into play. Malcolm has to try and convince Kaufman and the hospital administration to extend the therapy to the other patients. Despite not knowing the long term effects, Leonard, who was aware of his surroundings through his catatonic state, may have mixed emotions about his situation, wanting both to be treated as human being and an experiment guinea pig to ensure that what is happening benefits him and others in the long run. Mrs. Lowe may be unprepared for the new Leonard, she expecting who she remembers as a sweet eleven year old boy. Through all these issues, what may be the most illuminating issue for Malcolm is the need to stimulate the human spirit, including his own in dealing with people around him.', 121),
(144, 'Annie', 'English', 'Fantasy', '1982-06-18', 7, 'Metro-Goldwyn-Mayer (MGM)', 'https://m.media-amazon.com/images/M/MV5BYzU2YzA3NTYtNDg3OS00YTg3LThiODctZTQ3MzhkZDVjZDNlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 'In the depths of the 1930s, Annie (Aileen Quinn) is a fiery young orphan girl who must live in a miserable orphanage run by the tyrannical Miss Agatha Hannigan (Carol Burnett). Her seemingly hopeless situation changes dramatically when she is selected to spend a short time at the residence of the wealthy munitions industrialist, Oliver \"Daddy\" Warbucks (Albert Finney). Quickly, she charms the hearts of the household staff and even the seemingly cold-hearted Warbucks cannot help but learn to love this wonderful girl. He decides to help Annie find her long-lost parents by offering a reward if they would come to him and prove their identity. However, Miss Agatha Hannigan, her evil brother, Daniel Francis \"Rooster\" Hannigan (Tim Curry), and a female accomplice, plan to impersonate those people to get the reward for themselves, which puts Annie in great danger.', 127),
(145, 'Pet Sematary', 'English', 'Fantasy', '1989-04-21', 6, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BYjBlNTBhYWQtMzg5Yi00NDA2LWJmMjYtZmM0ODhiYzkwYmY5XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'Eager to start afresh, the young doctor, Louis Creed, and his family--his wife, Rachel, their daughter, Ellie, and their three-year-old toddler, Gage--move to their new home in the small rural town of Ludlow, Maine, alarmingly close to a busy highway. However, after the inadvertent death of Rachel\'s cherished tomcat in an awful accident, reluctantly, a desperate Louis will take his friendly neighbour\'s advice to bury it in an ancient Micmac graveyard: a mystical burial ground imbued with alleged reanimating powers. Now, despite the terrible results and the insistent warnings from a recently deceased, tragedy-stricken Louis has no other choice but to go back to the Indian cemetery, in high hopes that, this time, things will be different. Nevertheless, can the dead truly return from the grave?', 103),
(146, 'She\'s Gotta Have It', 'English', 'Thriller', '1986-08-08', 7, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BNGM3NzcwZjQtY2E5ZC00ODU0LTg1ODQtZDNlMGNiZTRlNWZkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'The story of Nola Darling\'s simultaneous sexual relationships with three different men is told by her and by her partners and other friends. All three men wanted her to commit solely to them; Nola resists being \"owned\" by a single partner.', 84),
(147, 'Eddie Murphy: Raw', 'English', 'Documentary', '1987-12-18', 8, 'A24', 'https://m.media-amazon.com/images/M/MV5BOWEwYTk4YTgtZGVjNi00MmI0LTkwOTItOWUxYzBlN2YwZWFkXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg', 'After achieving fame with Saturday Night Live and Beverly Hills Cop, Eddie Murphy released a film version of one of his live stand-up performances. He mainly focuses on the topics of divorce and relations between the sexes, but also goes into some of the problems he\'s encountered because of fame, including offended listeners and fans who continually greet him with his unprintable catch phrases.', 93),
(148, 'Endless Love', 'English', 'Drama', '1981-07-17', 5, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BMDQ3YWNhMjUtMjg3Zi00YmZhLTkzNDUtMzExN2FjZGMwNGIwXkEyXkFqcGdeQXVyMTUzMDUzNTI3._V1_SX300.jpg', 'David and Jade are high-school sweethearts and happy in love. But when Jades grades starts to drop her father forbid the young couple to see each other. Mad with frustration and desire David tries to reverse the decision, with catastrophic results.', 116),
(149, 'Mobile Suit Gundam II: Soldiers of Sorrow', 'Japanese', 'Animation', '1981-07-11', 7, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BOGM3YzdiNzgtOTJkYy00ZTYwLTlkMmMtNmZiMmMxYjU0NjFlXkEyXkFqcGdeQXVyMTA3NTQwNDU4._V1_SX300.jpg', 'After managing to survive attacks by Zeon\'s Char Aznable and Garma Zabi, the crew of Federation warship White Base and its mobile suits battle Zeon forces (Ramba Ral, Ma Kube, Tri-Stars, Boone) through Asia, Europe, and the Atlantic Ocean if they are to reach Earth Federation\'s headquarters alive. During that process many of its crewmembers like Amuro Ray, Bright Noah, Kai Shinden, Sayla Mass, Mirai Yashima, Fraw Bow, and Hayato Kobayashi must overcome their fears, losses, immaturities, and insecurities in order to survive.', 139),
(150, 'Mobile Suit Gundam: Char\'s Counterattack', 'Japanese', 'Animation', '1988-03-12', 7, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BMTE5OGJjZmQtZmI0Ni00YzU1LWE1OGItZGI5MDc3ODhlYjc1XkEyXkFqcGdeQXVyMTA3OTEyODI1._V1_SX300.jpg', 'Amuro and Char, two best mobile suit (robotic weapons) pilots who fought together against Titans after the Zeon\'s independence war, must face each other in a fateful duel where the Neo Zeon, led by Char, attempts to drop a gigantic asteroid and its nuclear weapons to Earth in order to cause Nuclear Winter to wipe out the Earth inhabitants.', 124),
(151, 'Sam Kinison: Breaking the Rules', 'English', 'Documentary', '1987-04-21', 7, 'Blue Sky Studios', 'https://m.media-amazon.com/images/M/MV5BMTgxNjMwNzUzM15BMl5BanBnXkFtZTcwMDg0NDMyMQ@@._V1_SX300.jpg', 'Fans old and new have cause for celebration with the release of Sam Kinison: Breaking All The Rules, HBO Special. Along with being voted onto Comedy Central\'s All-Time Top 20 Stand-Up Comedians list and VH-1\'s Top Comedians list, Sam seemed to be in a whole other class by himself. This comedy special will blow away the Kinison fan, and will be a must-have collectible. \"Sam was the cuddly anti-Christ...\" - Robin Williams. \"Sam scared the hell out of you...and was the funniest comedian...\" - Jay Leno. \"Sam took no prisoners...\" - Richard Pryor. \"Sam was an absolute comic genius...\" - Rodney Dangerfield. \"Sam\'s humor was based on truth and pushed the envelope like no other...\" - Larry King. \"Sam\'s voice was the voice of outrage...\" - Tim Matheson. \"Sam was one of our generation\'s greatest stand-up comics...\" - Howard Stern. \"Sam was one of my all time favorite comics...\" - Johnny Carson. \"Sam was outrageous, bright and absolutely screamed the truth...\" - Tom Lykis', 50),
(152, 'Tim Allen: Men Are Pigs', 'English', 'Documentary', '1990-09-07', 6, 'Studio Ghibli', 'https://m.media-amazon.com/images/M/MV5BNWJmMTEyOWItZDc1ZC00NjUwLWE0ZDMtZTNlNzRiMDFlNzViXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 'Tim Allen\'s first Showtime stand-up comedy special filmed in Kalamazoo, Michigan.', 30),
(153, 'Monty Python Live at the Hollywood Bowl', 'English', 'Documentary', '1982-06-25', 8, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BMzMyNzVjOTktZjVkNS00OTIxLWFjYWEtZjg0Mjc1MDBkNDMxXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', 'A collection of skits that made the Monty Python troupe famous, performed live at the Hollywood Bowl. Included are the singing philosophers, lumberjacks, the pope, and a suspiciously-male looking seabird vendor.', 77),
(154, 'The George McKenna Story', 'English', 'Biography', '1986-11-11', 6, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BMTY3OTgyMDM0OV5BMl5BanBnXkFtZTcwNjc1MjkxMQ@@._V1_SX300.jpg', 'The true story of a teacher in Los Angeles who becomes the Principal of George Washington Memorial High School. The school and its students are affected by the normal life of gangs and drugs in their lives. McKenna wanted to give the students a real choice at education and all it offered for their future. But he faced teachers used to the reality of their school, parents unable or unwilling to give the kids the support they needed, and kids just wanting to survive the streets never mind learning something. After Denzel Washington (George McKenna) became a superstar, the film was re-released on home video under the title Hard Lessons.', 100),
(155, 'Unspeakable Acts', 'English', 'Biography', '1990-01-15', 6, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BMTQ3MzYzMDA4MF5BMl5BanBnXkFtZTgwMjIwODY0MjE@._V1_SX300.jpg', 'Horrendous acts of sexual abuse were discovered at Miami\'s Country Walk Day Care Center in 1984. The ensuing investigations required unprecedented work and a pair of University of Miami psychologists were called upon for assistance. This case paved the way for a successful legislation in the protection of children during court proceedings and mandatory finger printing of adults who work with young children.', 100),
(156, 'Waiting for the Hearse', 'Spanish', 'Thriller', '1985-05-06', 8, 'A24', 'https://m.media-amazon.com/images/M/MV5BZjQxNWM3ODktZDQ2My00NDAyLWJkZDUtMWJiZWNjNTM2ZjU4XkEyXkFqcGdeQXVyMTk5MTE5MTg@._V1_SX300.jpg', 'Mamá Cora (Antonio Gasalla) is about 80 years old and she has three sons and a daughter. Mamá lives with one of them, unfortunately, the one who is in the worst economic position. One day, all the members of the family have a reunion to celebrate an anniversary. In the middle of the whole thing, an awkward question appears out of nowhere: ¿Who\'s going to be Mamá Cora\'s heir? ¿Who is going to take care of her during her last days in this world?. The answer is not easy and it doesn\'t take too long for the members of this bizarre family to start a terrible and yet hilarious fight. However, in the middle of the whole thing, they\'re interrupted by some disturbing breaking news.', 94),
(157, 'Mobile Suit Gundam III: Encounters in Space', 'Japanese', 'Animation', '1982-03-13', 8, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BNzNiOTRjZjMtZDQ4ZS00Njk0LWFiYTAtYjAxODc0ZjUyZjFmXkEyXkFqcGdeQXVyMTA3NTQwNDU4._V1_SX300.jpg', 'Amuro Ray and the rest of the White Base crew, now denominated the 13th Autonomous Corps, return to outer space to support the rest of the Earth Federation forces for the decisive battle against the Duchy of Zeon\'s forces.', 144),
(158, 'Agneepath', 'Hindi', 'Action', '1990-02-16', 8, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BOGIyNGNhN2EtYTZiNC00MDJjLWI2M2ItZjA1MTBlYmNiODNlXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Vijay (Amitabh Bachchan) father is brutally lynched by villagers after being framed by Kancha Cheena (Danny Denzongpa), and his family is forced to flee. The young Vijay vows revenge, and grows up protecting his sister and mother by becoming a gangster himself. Eventually he works his way up the ladder until he is face to face with the men who killed his father, but by this time he is little different from them, and his actions have put his family in the line of danger once more.', 174),
(159, 'Parrot Sketch Not Included: Twenty Years of Monty Python', 'English', 'Thriller', '1989-11-18', 8, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BMTkzNDA5MTA5MV5BMl5BanBnXkFtZTgwMzMzOTk1MDE@._V1_SX300.jpg', 'Steve Martin presents selected sketches from \"Monty Python\'s Flying Circus (1969)\". It\'s the well known sketches, though the parrot sketch is not included. Steve Martin has some funny comments on the Pythons.', 72),
(160, 'Too Young the Hero', 'English', 'Biography', '1988-03-27', 7, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BOWJjZmE3MmUtZjkyMC00YTAyLThkNWMtMWM2YjhlYjMyY2MyXkEyXkFqcGdeQXVyNzMwOTY2NTI@._V1_SX300.jpg', 'The true story of Calvin Graham who at the age of twelve, but looking quite a lot older, succeeded in joining the navy during World War II. In spite of his young age, he received a purple hart for his bravery in the battle of Guadalcanal. When he reported back to his unit after a leave, his world collapsed. Due to a misunderstanding he is reported as a deserter which is the start of a real nightmare.', 100),
(161, 'Adam: His Song Continues', 'English', 'Crime', '1986-09-29', 7, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BMjIwMDc1NTM3OV5BMl5BanBnXkFtZTgwNzAwODY0MjE@._V1_SX300.jpg', 'Follows the true story of John and Reve Walsh who, after their child was murdered, fought to raise national awareness of the problem of missing children.', 100),
(162, 'Disco Dancer', 'Hindi', 'Drama', '1982-12-10', 6, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BOWMyZTFjZDUtYzQ1Yi00OWJjLWJkYjgtZTVlZDQ3MDI1YzJhXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Anil is a performer dancing and singing on streets he and his mother are accused of stealing a guitar by P.N Oberoi out of shame they leave from Bombay.Years later in Goa Anil is singing and dancing at small functions and has dream of making it big.Sam Oberoi spoil brat of P.N Oberoi is big name in music world.David Brown his manager quits his job due to his arrogant behavior and challenges Sam he will create a new star opposite him.Mr Brown notices Anil and gives him a break where Sam\'s sister Rita is ready with her friends to spoil the event.When Anil starts dancing except Rita everyone follows him and show turns to be hit. Mr Brown arranges a show for him in Bombay the city where he and his mother was insulted.Sam and P.N Oberoi send goons to stop Anil from reaching the show.But he manages to reach and his performances becomes a big hit soon Anil turns into Jimmy a craze for every young star this destroys Sam\'s career.Rita realizes her mistake and teams up with Jimmy.But her father and brother want Jimmy to be finished and can go to any extent.', 135),
(163, 'The Ryan White Story', 'English', 'Biography', '1989-01-16', 7, 'New Line Cinema', 'https://m.media-amazon.com/images/M/MV5BMTQ0NjI2NTgtZWYxNy00M2JjLWEyODgtY2Q2NzJmMmUyOTE4XkEyXkFqcGdeQXVyMjczOTU2NTI@._V1_SX300.jpg', 'The story of Ryan White, a 13-year-old haemophiliac who contracted AIDS from factor VIII, which was used to control this disorder.', 105),
(164, 'Dil', 'Hindi', 'Thriller', '1990-06-22', 7, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BNzZiZTY0NTMtNTFhMC00OTA1LTg5ZmQtMjYwNThhNDJiOTVkXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Raja lives a poor lifestyle along with his dad, Hazariprasad and mom. He attends college where he has several run-ins with wealthy fellow-collegian, Madhu Mehra. Matters escalate to such an extent that she accuses him of sexually molesting her. When his dad comes to know, he decides to seize this chance to get rich quickly, masquerades as a wealthy businessman, approaches Mr. Mehra, and arranges for their children to get married. Murphy\'s law prevails at the time of the engagement - changing everyone\'s lives forever.', 172),
(165, 'Quiet Victory: The Charlie Wedemeyer Story', 'English', 'Drama', '1988-12-26', 7, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BY2ExOGI3ZjAtM2FlNS00MWIxLTg4ZjYtYTg4NjVhNDU0ZjEyXkEyXkFqcGdeQXVyMzU0NzkwMDg@._V1_SX300.jpg', 'A real-life story about a high school teacher and football coach who is diagnosed with Lou Gehrig\'s disease but refuses to give in.', 100),
(166, 'Alexandria: Again and Forever', 'Arabic', 'Drama', '1990-06-20', 6, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BMWYxNzdlOGYtOTliMC00Mzc1LWE4MjMtYjkxZjlhOWY3ZWQ1XkEyXkFqcGdeQXVyMjI4NzAzNjg@._V1_SX300.jpg', 'During a hunger strike by the Egyptian film industry, Yehia, a famous Egyptian director, finds himself obsessed with Amir, the leading man in one of his movies, and Nadia, a woman he desires to work with.', 100),
(167, 'Strange Voices', 'English', 'Drama', '1987-10-19', 6, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BMTU5MTU4MzIxNV5BMl5BanBnXkFtZTgwODAwODY0MjE@._V1_SX300.jpg', 'A family begins to fall apart when they find out their eldest daughter, Nancy McKeon, is a victim of schizophrenia.', 100),
(168, 'A Stoning in Fulham County', 'English', 'Crime', '1988-10-24', 6, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BMTY3MDE0OTY5OV5BMl5BanBnXkFtZTgwMDEwODY0MjE@._V1_SX300.jpg', 'Religious beliefs clash with the law when an Amish infant is killed in a rural community.', 94),
(169, 'Muqaddar Ka Faisla', 'Hindi', 'Action', '1987-06-26', 5, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BYzQ3ZmM5YTEtYzI5NC00ZTZhLWE3ZTEtOThjMDc4MWZjZjY0XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'An honest Hindu pandit (priest) is framed for embezzlement and rape, and not only dismissed from employment, but also arrested and imprisoned, leaving behind his family in destitution. On his return from prison, he is unable to locate his family, and plans to avenge his humiliation. But the challenge is that how can a former pandit, ex-convict, penniless, homeless, and without any resources, avenge himself against the cunning and manipulative people who framed him?', 171),
(170, 'Little Wars', 'French', 'Drama', '1983-02-09', 6, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BZGE2NWM5YjgtMGY4MS00NmMxLThkOGYtMzNjNzA0NTg1ZmUxXkEyXkFqcGdeQXVyMzI4MTk3MTY@._V1_SX300.jpg', 'Lebanon, 1975. How Tahal, an affluent young man becomes a warlord ; how Soraya, the girl he leaves behind, tries to help him in abducting a businessman ; how Nabil, a press photographer deals drugs under the cover of the civil war and poses as the hero he aspires to be but is not at all...', 108),
(171, 'Duniya', 'Hindi', 'Action', '1984-09-18', 6, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BM2E0MGZmN2QtYWUzZi00NjdlLTg1NTAtNGQzMTcxYTNjMzU0XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Mohan Kumar\'s diligence and honesty lands him in trouble with Balwant Singh Kalra, Jugal Kishore Ahuja, and Mr. Bhandari. Together the trio frame and imprison Mohan and make him watch helplessly as his wife is killed. Years later, Mohan Kumar is released from prison, his only goal in life is to avenge his humiliation and wrongful arrest at the hands of the trio. With the help of Dinesh Verma, he establishes himself again, and starts the process of bringing death and destruction to the trio. The trio are well aware of his presence, and decide to send one of their men, Ravi, to spy on him. Ravi falls in love with Verma\'s daughter, Roma, and decides to change sides to help Verma and Mohan, but Mohan will not have anything to do with Ravi, and asks him to leave. Ravi then becomes a target by the trio and their men, and has to save himself, and the only way he can redeem himself is by turning the tables over Mohan, who is none other than his own father.', 169),
(172, 'Pyar Ke Do Pal', 'Hindi', 'Action', '1986-08-15', 6, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BYTMyMGM5YjgtMjMzMS00OGI3LWE0OGQtNjIyMTA5NTJkZjQyXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Geeta Choudhary has an abortion in the name of her close friend Rajni Thakur so that Rajni can get married. When her secret leaks out, Geeta\'s husband Ashok blames her, accuses her of being unfaithful, and drives her out of their home. They have twins, Sunil and Anil. and each parent is allowed custody of one twin. Years later the twins meet at Scout camp and decide to reunite their parents, not realizing that they\'re exposing their parents and each other to danger and death.', 130),
(173, 'Mujrim', 'Hindi', 'Action', '1989-06-28', 5, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BOWQwZWE5MjctMTlkYy00NWUwLTg0ZTktZmUxYzcxZGE4NWNkXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Yashoda has been widowed for years, but has brought up her two children with lot of love, care, and honesty. She is disappointed when her son, Shankar, who is arrested for breaking the law, and subsequently jailed, and she decides she will have nothing to do with him. She runs her life and is not dependent on anyone. When Shankar comes out of jail, he tries to make amends, but Yashoda outrightly refuses to have anything to do with a criminal.', 163),
(174, 'An Egyptian Story', 'Arabic', 'Drama', '1983-08-03', 7, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BZDdhOGNmNGYtOWNjNS00YjA0LWI5ZDAtNGNiYzBmM2JmYzkxXkEyXkFqcGdeQXVyMjI4NzAzNjg@._V1_SX300.jpg', 'In the middle of his own heart surgery, an Egyptian filmmaker remembers his life. In fact his old self, as a child, is accused of attempted murder of his new self. Through the metaphoric trial, we are drawn into his life in relation with the Egyptian revolution, his constant need for success, and the effect the American Dream has on him.', 115),
(175, 'Ek Jaan Hain Hum', 'Hindi', 'Family', '1983-09-16', 6, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BNGVkYThhMzQtMDQ4Ni00NzliLThlMDUtOGY1NWIyYmI1NDk2XkEyXkFqcGdeQXVyMDkwNTkwNg@@._V1_SX300.jpg', 'Coming from a decent upper middle-class family, Vikram Saxena meets with gorgeous Seema Singh, and both fall in love. But their respective families have other plans for them. While Vikram is able to convince his advocate dad, Shyam Sunder, to change his mind, Seema is unable to do so, and her marriage is being planned with a U.S. resident. Things take a turn for the worst when the police arrest Vikram with arson, with evidence that he had burned down a property belonging to Seema\'s dad, Colonel Ram Mohan Singh. Due to this, Vikram\'s dad comes forward to defend him, and Seema will not have anything to do with him anymore. Shyam Sunder realizes that the only way he can save his son from being imprisoned is to have him certified as insane, but will have to live with the consequences for the rest of his life, as well as the the stigma this will place on his family for years to come.', 151),
(176, 'The Quick and the Dead', 'English', 'Action', '1995-02-10', 6, 'Studio Ghibli', 'https://m.media-amazon.com/images/M/MV5BOTI2ZTZmMmItMmM3YS00ZjUwLWJiODMtMmRjMWM4NDE0OWFhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'Ellen, an unknown female gunslinger rides into a small, dingy and depressing prairie town with a secret as to her reason for showing up. Shortly after her arrival, a local preacher, Cort, is thrown through the saloon doors while townfolk are signing up for a gun competition. The pot is a huge sum of money and the only rule: that you follow the rules of the man that set up the contest, Herod. Herod is also the owner, leader, and \"ruler\" of the town. Seems he\'s arranged this little gun-show-off so that the preacher (who use to be an outlaw and rode with Herod) will have to fight again. Cort refuses to ever use a gun to kill again and Herod, acknowledging Cort as one of the best, is determined to alter this line of thinking ... even if it gets someone killed ...', 108),
(177, 'Forrest Gump', 'English', 'Drama', '1994-07-06', 9, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BNWIwODRlZTUtY2U3ZS00Yzg1LWJhNzYtMmZiYmEyNmU1NjMzXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'Forrest Gump is a simple man with a low I.Q. but good intentions. He is running through childhood with his best and only friend Jenny. His \'mama\' teaches him the ways of life and leaves him to choose his destiny. Forrest joins the army for service in Vietnam, finding new friends called Dan and Bubba, he wins medals, creates a famous shrimp fishing fleet, inspires people to jog, starts a ping-pong craze, creates the smiley, writes bumper stickers and songs, donates to people and meets the president several times. However, this is all irrelevant to Forrest who can only think of his childhood sweetheart Jenny Curran, who has messed up her life. Although in the end all he wants to prove is that anyone can love anyone.', 142),
(178, 'Happy Gilmore', 'English', 'Thriller', '1996-02-16', 7, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BZWI2NjliOTYtZjE1OS00YzAyLWJjYTQtYWNmZTQzMTQzNzVjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'A Hockey player wannabe finds out that he has the most powerful golf drive in history. He joins the P.G.A. tour to make some money to save grandma\'s house. The downside is that his hockey player mentality doesn\'t really go on the P.G.A. tour. Especially with the favorite to win the championship.', 92),
(179, 'Saving Private Ryan', 'English', 'Drama', '1998-07-24', 9, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BZjhkMDM4MWItZTVjOC00ZDRhLThmYTAtM2I5NzBmNmNlMzI1XkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_SX300.jpg', 'Opening with the Allied invasion of Normandy on 6 June 1944, members of the 2nd Ranger Battalion under Cpt. Miller fight ashore to secure a beachhead. Amidst the fighting, two brothers are killed in action. Earlier in New Guinea, a third brother is KIA. Their mother, Mrs. Ryan, is to receive all three of the grave telegrams on the same day. The United States Army Chief of Staff, George C. Marshall, is given an opportunity to alleviate some of her grief when he learns of a fourth brother, Private James Ryan, and decides to send out 8 men (Cpt. Miller and select members from 2nd Rangers) to find him and bring him back home to his mother...', 169),
(180, 'Gattaca', 'English', 'Drama', '1997-10-24', 8, 'Pixar Animation Studios', 'https://m.media-amazon.com/images/M/MV5BOWRhZDMwMzEtNDYzNy00N2U4LWIzNGMtMmIyY2M3YWFjM2VkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'In the not-too-distant future, a less-than-perfect man wants to travel to the stars. Society has categorized Vincent Freeman as less than suitable given his genetic make-up and he has become one of the underclass of humans that are only useful for menial jobs. To move ahead, he assumes the identity of Jerome Morrow, a perfect genetic specimen who is a paraplegic as a result of a car accident. With professional advice, Vincent learns to deceive DNA and urine sample testing. Just when he is finally scheduled for a space mission, his program director is killed and the police begin an investigation, jeopardizing his secret.', 106),
(181, 'Blade', 'English', 'Action', '1998-08-21', 7, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BYTU1ZTI0YjUtZGRlMS00MDU1LWFmZmItZWRiYTg5NTExMmRjXkEyXkFqcGdeQXVyMTUzMDg3MTQw._V1_SX300.jpg', 'In a world where vampires walk the earth, Blade has a goal. His goal is to rid the world of all vampire evil. When Blade witnesses a vampire bite Dr. Karen Jenson, he fights away the beast and takes Jenson back to his hideout. Here, alongside Abraham Whistler, Blade attempts to help heal Jenson. The vampire Quinn who was attacked by Blade, reports back to his master Deacon Frost, who is planning a huge surprise for the human population.', 120),
(182, 'You\'ve Got Mail', 'English', 'Thriller', '1998-12-18', 7, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BZTcxNzgzZjMtYzZiZC00MmE1LTg3MzQtZDAxMTYyZWE4MDNhL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'This sweet romantic comedy reunites Sleepless In Seattle stars Meg Ryan and Tom Hanks. He\'s the owner of a bookstore chain; she\'s the woman he falls for online. Both are unaware that she runs the little shop his company is trying to shut down.', 119),
(183, 'Starship Troopers', 'English', 'Action', '1997-11-07', 7, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BNWExNzg3MmMtYjc3MS00MzFlLWJiOWQtNWYxZTgxNjhlZTQ2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 'In the distant future high school kids are encouraged to become citizens by joining the military. What they don\'t know is that they\'ll soon be engaged in a full scale war against a planet of alien insects. The fight is on to ensure the safety of humanity.', 129),
(184, 'Donnie Brasco', 'English', 'Biography', '1997-02-28', 8, 'New Line Cinema', 'https://m.media-amazon.com/images/M/MV5BYzMzMDZkYWEtODIzNS00YjI3LTkxNTktOWEyZGM3ZWI2MWM4XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 'This true story follows FBI agent Joe Pistone as he infiltrates the mafia of New York. Befriending Lefty Ruggiero, Pistone (under the name Donnie Brasco) is able to embed himself in a mafia faction led by Sonny Black. Ruggiero and Pistone become tight as the group goes about collecting money for \'the bosses\'. Eventually, the group become big-time when Black himself becomes a boss; all the while, Pistone collects evidence. However, the trials and tribulations of the undercover work become more than Pistone can bear. His marriage falls apart, and to top it off, the mafia suspect a mole in the organization. The real dilemma is afforded to Pistone, who knows if he walks away from the mafia, Ruggiero will be the one punished.', 127),
(185, 'U.S. Marshals', 'English', 'Action', '1998-03-06', 7, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BYmM1MTVhMzctMWVhNi00NDM0LWJlNGItMDE4ZTY0ZTAwODgzXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', 'When a prisoner transport plane crashes, one prisoner, Mark Sheridan, skillfully escapes and saves lives at the same time. Deputy Sam Gerard and his team of U.S. Marshals pursue relentlessly, but Gerard begins to suspect that there is more to the exceptional fugitive than what he has been told. Meanwhile, Sheridan struggles to avoid capture while seeking answers of his own. Until the final scene, both Gerard and Sheridan are in jeopardy of the unknown.', 131),
(398, 'Ala Vaikunthapurramuloo', 'Telugu', 'Action', '2020-01-11', 7, 'Blue Sky Studios', 'https://m.media-amazon.com/images/M/MV5BMmRkMGMzYTUtM2E2My00YjZlLWFmZjItMDA5M2EwNjNiZTNjXkEyXkFqcGdeQXVyNDY5MTUyNjU@._V1_SX300.jpg', 'The narrative revolves around Bantu (Allu Arjun), a skilled middle-class man who is despised and often neglected by his father Valmiki (Murali Sharma). What Bantu doesn\'t know is that he\'s actually the son of a businessman swapped by Valmiki with his own son to give the latter a comfortable life. A violent incident draws Bantu closer to the truth, upon learning which he decides to enter Vaikunthapuram, the home of his real parents and eventually confront those who threaten his family.', 163),
(399, 'Too Handsome to Handle', 'Indonesian', 'Anime', '2019-01-31', 7, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BMzcwYjY3ZjktODgyYy00ZWM5LWJhNzgtYzE4MmM4MjQ0ZjQwXkEyXkFqcGdeQXVyNzY4NDQzNTg@._V1_SX300.jpg', 'Witing Tresno Jalaran Soko Kulino aka Mas Kulin who is too handsome always avoids entering regular school and chooses to spend almost 100% of his life inside the house. He makes his father, Mr. Archewe, his mother, Bu Suk, and his brother, Mas Okis, worry. They arrange a scenario that succeed in making Mas Kulin agree to spend the last year of his high school years at a special school for boys, Horridson High School. Mas Kulin\'s handsomeness is then exposed to the outside world so his days go unusual: female teachers faint and he becomes the target of BBM High School students. Including a girl that is too beautiful: Amanda. However, in the midst of all that, Mas Kulin find Kibo and Rere, which make him believe that there are still people who can see him as he is.', 106),
(400, 'Miranda Sings Live... Your Welcome', 'English', 'Anime', '2019-06-04', 5, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BNzcyYjhhNWMtZTA4NS00MDMwLWE4ODMtMGNhZjIwYTI2ODJhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Viral video star Miranda Sings and her real-world alter ego Colleen Ballinger share the stage in a special packed with music, comedy and \"magichinry.\"', 61),
(401, 'Alien Warfare', 'English', 'Action', '2019-04-05', 3, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BNWViOWNlZjQtMzJlNi00OTg0LTg3N2QtYWU0NmIxOGU2ODk4XkEyXkFqcGdeQXVyNDk0NDc0Nzk@._V1_SX300.jpg', 'A team of Navy Seals investigates a mysterious science outpost only to have to combat a squad of formidable alien soldiers.', 88),
(402, 'A Kid from Coney Island', 'English', 'Documentary', '2020-02-10', 7, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BYzQyYjYyMmMtNWVlMS00ZGFiLWE3MmItNWQ2ODkxMTQ1YTAzXkEyXkFqcGdeQXVyMTA3MzQ4MTg0._V1_SX300.jpg', 'Feature documentary about the rise and fall, and rebirth of ex-NBA star, Stephon Marbury.', 95),
(404, 'Pegasus', 'Mandarin', 'Anime', '2019-02-05', 6, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BZDNkYjIxZjYtNzQ0NS00OTA4LTk2MDctZWViMDcwYzZmNjAwXkEyXkFqcGdeQXVyODEyNjc0ODU@._V1_SX300.jpg', 'Five years ago, veteran driver Zhang Chi was suspended for illegal racing. When he returned to the game, he found himself starting all over again. After some difficulties, he and his car appeared again on the Bayinbrooke circuit. He\'s willing to risk everything, including his life, in order to win.', 98),
(405, 'Mnahi', 'Arabic', 'Anime', '2020-06-17', 6, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BNzRhYjU5ZWMtZWNjMC00OGFjLWIwYzEtYjQyMjI4YTQ0NzE3XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Menahi is a Saudi Bedouin young man, single and living with his old mother. He is a simple, spontaneous and kind-heart man, instinctive and adhering to the ethics of the environment from which he emerged, such as honesty, honor and virility. He dreams of owning a small farm to raise sheep. But he went out into the city and didn\'t adapt to civic life.', 100),
(406, 'The Wrong Missy', 'English', 'Comedy', '2020-05-13', 6, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BY2QwZWJlZjMtNzU5NC00NTA0LWI1MjQtYWQ1ZTg4NWZmNjdkXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_SX300.jpg', 'Tim thinks he\'s invited the woman of his dreams on a work retreat to Hawaii, realizing too late he mistakenly texted someone from a nightmare blind date.', 90),
(407, 'Jiu Jitsu', 'English', 'Action', '2020-11-20', 3, 'A24', 'https://m.media-amazon.com/images/M/MV5BOWU2YzRlYzYtNDE0Mi00NzhkLTkxYWItZDMxNmQxZmRjZWY2XkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_SX300.jpg', 'When Jake Barnes, a master Jiu Jitsu fighter, refuses to face Brax, an indomitable alien creature, the future of humanity hangs in the balance. Injured and suffering from severe amnesia, Jake is captured by a military squad unequipped to fight the merciless intruder who has descended upon the planet. Jake is rescued by Wylie, and an ancient order of Jiu Jitsu fighters who must help him recover his memory and regain his strength in order to band together and defeat Brax in an epic battle that will determine the fate of mankind.', 102),
(408, 'An Easy Girl', 'French', 'Comedy', '2020-08-13', 6, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BYjRiYmQ5MTAtZDI5OS00MjI3LTlkNjctY2Q1MTM2MGQwZDk1XkEyXkFqcGdeQXVyNTYxNTc2OTg@._V1_SX300.jpg', 'Naïma16, daughter of a cleaning lady, is about to join an audition with her best friend Dodo in Cannes. The school year is over. It was then that her 22-year-old cousin Sofia arrives from Paris to spend the holidays with her. She is a young woman with a liberated sexuality and does not hesitate to take advantage of her charms. \"Catch the moment\" is her main motto. Inseparable, foaming beaches and nightclubs, the two accomplices are quick to meet Andres and Philippe, an art collector and his regular matchmaker. Two rich men invite them to their yacht. Sofia then turns Naïm from her everyday reality to the world of luxury, opulence, haute couture, great restaurants, sumptuous Mediterranean villas. This world where everything seems possible.', 92),
(409, 'Patria', 'Spanish', 'Documentary', '2019-01-18', 7, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BMmRmYTVjNjItMjE5Yi00ZTI5LWIxN2ItYjJlMTI1Y2Q5OTU5XkEyXkFqcGdeQXVyNzQ3MDc3ODI@._V1_SX300.jpg', 'An exploration of a critical era in Mexican politics and political independence that still impacts Mexico today: 1854 to 1867. Through creation of the republic, coup, counterrevolution, and foreign invasion and using visits to historic battlefields and towns, as well as works of art and primary source documents, the narrator argues that this time period still influences Mexico today.', 89),
(410, 'Chief Daddy', 'English', 'Comedy', '2018-12-14', 5, 'Marvel Studios', 'https://m.media-amazon.com/images/M/MV5BNzhkZTIzN2QtNjhmNC00OGFlLWFmMjYtZjJhYzM1Zjg4OTkzXkEyXkFqcGdeQXVyNzgzMTc2OTA@._V1_SX300.jpg', '\'Chief Daddy\' tells the story of billionaire industrialist Chief Beecroft, a flamboyant benefactor to a large extended family of relatives, household staff, and assorted mistresses. Chief lives large, like there\'s no tomorrow, until the day there is no tomorrow--he dies suddenly and the \'bullion van\' stops. What\'s in his will, and who gets all that money? Will Chief Daddy have the last laugh from beyond the grave?', 99),
(411, 'The Scary House', 'German', 'Drama', '2020-10-30', 5, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BNzJjNTMzNTMtNTFlNS00M2MzLWJlMTgtMjRiMjgwNDAyZmUyXkEyXkFqcGdeQXVyNjE0NjcyMTQ@._V1_SX300.jpg', 'Hendrik is sixteen, a big city kid, and vexed to learn that his mother is moving with him and his little brother Eddi to a village in the south of Austria. To make matters worse, the locals shun the new rustic family home. They say it has been haunted ever since a mother poisoned her two sons in there many decades ago. When a sleep- walking Eddi starts carving strange symbols into the walls, Hendrik and his friends set off on a quest to lift the secret of the spooky house.', 100),
(412, 'Like a Rolling Stone: The Life & Times of Ben Fong-Torres', 'N/A', 'Documentary', '2022-05-06', 7, 'Paramount Pictures', 'https://m.media-amazon.com/images/M/MV5BY2IyNGI0Y2UtMmVmOS00YWU0LWJhZDAtODE5MTU1ZmU0MWFlXkEyXkFqcGdeQXVyMTQ0NzM4NTg@._V1_SX300.jpg', 'The documentary about Ben\'s life is an epic sweep through the world of rock and roll. The American-born son of Chinese immigrants, Ben grew up in Chinatown with only a radio to the outside world.', 99),
(413, 'Unbroken', 'Hindi', 'Documentary', '2019-01-26', 9, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BZWQ1NzcwYjEtMzNkNy00Y2RlLTg5MGEtMWQzNTExYjM4OTE2XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'The movie traces three real-life incidents that took place in \'80s, 90s and 2000s respectively through the stories titled \'Orphan and the Convict\', \'The Farmer and the Nun\' and \'The Terror and the Mom\'.', 110),
(414, 'Bhai - Vyakti Ki Valli 2', 'Marathi', 'Biography', '2019-02-08', 8, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BYTE3MGVkNGItY2E4Mi00ZGFkLTk5MGUtYmVlYTA2ZmNhN2FiXkEyXkFqcGdeQXVyNjE1OTQ0NjA@._V1_SX300.jpg', 'Bhai being popular with his writings gets job at Doordarshan but soon quits it as his first love for stage.It also depicts life of Bhai and Mai\'s social work towards society on how they helped to create a blood bank and social work with Baba Amte.While he also got a chance to enter politics which he let it go.', 130),
(415, 'The Half of It', 'Spanish', 'Comedy', '2020-05-01', 7, 'New Line Cinema', 'https://m.media-amazon.com/images/M/MV5BY2RlZmZkOTUtMDI5Ni00ZjZmLWI1OTItZmUwNWE4ZWVjNzFiXkEyXkFqcGdeQXVyMTkzODUwNzk@._V1_SX300.jpg', 'A shy, introverted, Chinese-American, straight-A student finds herself helping the school jock woo the girl they both secretly love. In the process, each teaches the other about the nature of love as they find connection in the most unlikely of places.', 104),
(416, 'Bad Trip', 'English', 'Comedy', '2021-03-26', 6, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BNDgzMTgxOTktNmM2Ny00Nzk5LTgxNjAtNzJlNjBjNjMyOWZkXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg', 'This mix of a scripted buddy comedy road movie and a real hidden camera prank show follows the outrageous misadventures of two buds stuck in a rut who embark on a cross-country road trip to NYC. The storyline sets up shocking real pranks.', 86),
(417, 'Wheels of Fortune', 'English', 'Comedy', '2020-11-01', 5, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BNGRlMjBiODEtMzA0MS00YzJjLWFjMTktOGY5OGJjMzkxYTQ4XkEyXkFqcGdeQXVyNjk0MTExOQ@@._V1_SX300.jpg', 'To claim a big inheritance, a down-on-his-luck mechanic must win a series of competitions as outlined in his birth father\'s will.', 106),
(418, 'The Vault', 'English', 'Action', '2021-03-26', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BZTliM2M5MjktZmY2NC00NjdlLWE5YzUtNDU2NzA0MzkyMDNlXkEyXkFqcGdeQXVyMTE1Nzg4NjY0._V1_SX300.jpg', 'Thom, a genius engineering graduate, is interested in the Bank of Spain\'s safe. The Bank building is more than 100 years old, with no building blueprints available and a security system that includes an underground river that will flood the safe room if their walls are breached. As soon as Thom learns that a legendary lost treasure is going to be held at the bank\'s safe for just ten days, he devises, together with charismatic art dealer Walter \"Cunningham,\" a detailed plan to break in. They will only have 105 minutes to do so while the Bank\'s staff will be distracted, watching the 2010 Football World Cup final match, played by Spain\'s national football team and broadcast on a giant screen, coincidentally placed just in front of the Bank of Spain building.', 118),
(419, 'Mi Amigo Alexis', 'Spanish', 'Adventure', '2019-05-30', 5, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BNjA5YzliYjQtZjJjNy00MDQ0LWE3ODctM2ViZWI4MGI0MGZlXkEyXkFqcGdeQXVyMTcxNTYyMjM@._V1_SX300.jpg', 'Tito is thirteen years old and he breathes football since the day he was born. His father has trained him all his life to achieve the success that he could never obtain. After a Chilean team workout, Tito will establish a relationship with Alexis Sánchez, who will help him discover his true dream.', 100),
(420, 'Kill Me If You Dare', 'Turkish', 'Comedy', '2019-09-06', 4, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BOWZhZDI4ZmItOWE4MS00ZmFjLTg4MzMtMWUxNDczMjA0ZDAzXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Can the excitement of the national lottery save a finished marriage? Or is it the end of that marriage? In this fun comedy, Demet and Okan will learn the answer to this question.', 104),
(421, 'NiNoKuni', 'Japanese', 'Animation', '2019-08-23', 6, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BNDM3Y2YzZWUtMGQ2Yy00NDQ0LThmMjEtMWE3Mjc4YzcwODZhXkEyXkFqcGdeQXVyNjc3MjQzNTI@._V1_SX300.jpg', 'High schooler Yuu and his friend Haru get involved in a case involving his childhood friend Kotona, which forces them to go back and forth between another world that is different but is somewhat similar to their world, Ni no Kuni. The real world and Ni no Kuni, when Kotona\'s life is in danger, what\'s the ultimate choice the three of them have to make in Ni no Kuni?', 106),
(422, 'DTC -Yukemuri Junjou Hen- from HiGH & LOW', 'Japanese', 'Comedy', '2018-09-28', 7, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BMDJiYTg3YjMtOWEwOS00YTEzLTgyMzUtNThjM2Q2YmE3Yjk2XkEyXkFqcGdeQXVyNjIzODk2Mzg@._V1_SX300.jpg', 'Dan, Tettsu and Chiharu (DTC) were exhausted after all those exciting days. Yet what awaits them is an extremely boring life. In order to seek for excitement and youth (and girls), the trio goes on a motorcycle trip without a specific destination. But they soon spend all their money and have to do part-time jobs in a hotel at the hot spring resort... There, they meet the young proprietress Mari and her only daughter Megumi. Chiharu grows fond of Mari who takes care of her daughter and runs the hotel alone after her husband died. However, Chiharu knows that Mari and the head-clerk Miyazaki are attracted to each other. To help the two who cannot get married because of her daughter, the trio decides to carry out a certain plan with the assistance from their friends the Tatebue Brothers as well as SMG and Daruma Babies who used to be rivals! What is the end of DTC\'s unbelievable pure trip...?', 102),
(423, 'Bhangra Paa Le', 'Hindi', 'Comedy', '2020-01-03', 6, 'Miramax Films', 'https://m.media-amazon.com/images/M/MV5BOTg2NGEzNWUtZjFlNi00NmY4LTg0MzgtZDBiYzI1N2ViYjEzXkEyXkFqcGdeQXVyOTg4MzcyNzQ@._V1_SX300.jpg', 'Jaggi, who hails from a Punjabi background, wants to exhibit Bhangra on a big platform as he is deeply attached to the dance form. The film showcases a college rivalry where they compete with each other to win the international dance competition.', 131),
(424, 'Tughlaq Durbar', 'Tamil', 'Comedy', '2021-09-10', 5, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BODY5NzEzZTItZTk3OS00YjQ2LThjNzgtMTQzOWRmZjljZDliXkEyXkFqcGdeQXVyODEyNjEwMDk@._V1_SX300.jpg', 'A budding politician has devious plans to rise in the ranks, until he suddenly develops an alter ego that interferes with his every crooked move.', 145),
(425, 'Amy Schumer: Growing', 'English', 'Comedy', '2019-03-19', 5, 'Touchstone Pictures', 'https://m.media-amazon.com/images/M/MV5BOTZjMGZiODgtMjNhMC00ODIwLTk2ZDItOTNhMDZmMmNlYThlXkEyXkFqcGdeQXVyNjg2NjQwMDQ@._V1_SX300.jpg', 'Amy Schumer\'s live stand-up set performed in Chicago where she jokes about marriage, pregnancy and personal growth.', 60),
(426, 'Da 5 Bloods', 'English', 'Adventure', '2020-06-12', 6, 'A24', 'https://m.media-amazon.com/images/M/MV5BYWUyODVjNjItZWYyMy00YjUxLWI3YTgtNTVlYTMzZmFiNzE3XkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg', 'From Academy Award® Winner Spike Lee comes a new joint: the story of four African American Vets - Paul (Delroy Lindo), Otis (Clarke Peters), Eddie (Norm Lewis), and Melvin (Isiah Whitlock, Jr.) - who return to Vietnam. Searching for the remains of their fallen Squad Leader (Chadwick Boseman) and the promise of buried treasure, our heroes, joined by Paul\'s concerned son (Jonathan Majors), battle forces of Man and Nature - while confronted by the lasting ravages of The Immorality of The Vietnam War.', 154),
(427, 'John Leguizamo\'s Latin History for Morons', 'English', 'Comedy', '2018-11-05', 7, '20th Century Fox', 'https://m.media-amazon.com/images/M/MV5BYzYwMmM3ZDYtOTdiOS00MWNlLThjNzEtOTE1YWY5ZWRhOTlmXkEyXkFqcGdeQXVyODc5NDYwMTI@._V1_SX300.jpg', 'Comic and actor John Leguizamo examines the repression of Hispanic culture throughout American history in his one-man show \"Latin History for Morons.\"', 91),
(428, 'The Kissing Booth 2', 'English', 'Comedy', '2020-07-24', 6, 'A24', 'https://m.media-amazon.com/images/M/MV5BOWQ5ZGU2ZGQtOTJjYi00MWI3LWE1ZDQtM2EzOGI2MzJjNTA4XkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg', 'Elle Evans (Joey King) just had the most romantic summer of her life with her reformed bad-boy boyfriend Noah Flynn (Jacob Elordi). But now Noah\'s off to Harvard, and Elle\'s headed back to high school for her senior year. She\'ll have to juggle a long-distance relationship, getting into her dream college with her best friend Lee (Joel Courtney), and a new friendship with handsome classmate Marco (Taylor Perez). When Noah grows close to a seemingly-perfect college girl, Elle will have to decide how much she trusts him, and just what - and who - her heart truly wants. Director and screenwriter Vince Marcello returns for THE KISSING BOOTH sequel, based on characters from Beth Reekles\' 2012 young adult book.', 134),
(429, 'The Vanished', 'English', 'Action', '2020-08-21', 6, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BYmU0MWZhNmQtOGQ4MC00ZTVlLTkwMTctYzBiY2Q1ZjQyYWJmXkEyXkFqcGdeQXVyODk4OTc3MTY@._V1_SX300.jpg', 'A husband and wife will stop at nothing to find their missing daughter, who disappeared on a family camping trip. When the police don\'t have any leads, the duo takes over.', 115),
(430, 'Sang Krasue', 'Thai', 'Drama', '2019-03-14', 6, 'Blue Sky Studios', 'https://m.media-amazon.com/images/M/MV5BMTYzODY3ZDktOWI1Yy00MDZhLWI0NGMtNTg1ZjdjYTVmOWRlXkEyXkFqcGdeQXVyNjYyODQ0NDY@._V1_SX300.jpg', 'In a far-away village, lived an innocent teenage girl, \"Sai\" who later discovered herself inheriting the curse of \"Krasue\". At night, her head would detach from her body and hunts for flesh and blood. Villagers are terrified by the deaths of their livestocks and that is when the Krasue hunt begins. \"Jerd\" a friend joined the hunt with an unknown reason while \"Noi\", the childhood friend who had just came back to the village decided to stand beside Sai despite knowing the horrifying truth.', 122);
INSERT INTO `CONTENT` (`contentID`, `title`, `language`, `genre`, `releaseDate`, `rating`, `productionStudio`, `image`, `summary`, `runtime`) VALUES
(431, 'I Lost My Body', 'French', 'Animation', '2019-11-15', 7, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BNDZjZjQ3ZDYtZmY2OS00MmE2LWE1ZDQtMWMyZmFlMmVjMjY0XkEyXkFqcGdeQXVyMTMxODU3NzM@._V1_SX300.jpg', 'In a Parisian laboratory, a severed hand escapes its unhappy fate and sets out to reconnect with its body. During a hair-raising escapade across the city, the extremity fends off pigeons and rats alike to reunite with pizza boy Naoufel. Its memories of Naoufel and his love for librarian Gabrielle may provide answers about what caused the hand\'s separation, and a poetic backdrop for a possible reunion between the three. Based on Guillaume Laurant\'s novel \"Happy Hand.\"', 81),
(432, 'Isi & Ossi', 'German', 'Comedy', '2020-02-14', 6, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BODljYmUyOTctOWFlYS00MzcxLWE1MjMtNjdjM2E2NzcyYjM1XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Rich girl Isabella, a culinary wanna-be, hooks up with poor boy Oscar, a would-be prize fighter, to strong-arm her parents into permitting her to enter a culinary school (which they deem unbefitting) by dating him. Both come from disagreeable families and would seem worlds apart, but their same taste in rap music may suggest an underlying compatibility that their surface differences (and artificial relationship) would project.', 113),
(433, 'Rising High', 'German', 'Comedy', '2020-04-17', 6, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BYTVjNDE3NjktYmMyNC00MTRmLTlmZWItMzk3NzViY2Y4MmFhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Charting the rise and fall of three corrupt real estate agents who accumulate absurd wealth in no time but fall into a vortex of fraud, greed and drugs.', 94),
(434, 'All the Freckles in the World', 'Spanish', 'Comedy', '2019-09-27', 5, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BMGUxOTliMGUtNWI5NS00MzY0LWFiMDMtNjQ5MzhmOWEyYjFhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', '\"All the Freckles in the World,\" set in 1990s Mexico City, is the story of a young-teen boy who is trying to get the attention of the prettiest girl at his school.', 91),
(435, 'A Second Chance: Rivals!', 'English', 'Drama', '2020-02-05', 5, 'Focus Features', 'https://m.media-amazon.com/images/M/MV5BN2NlNDM1MzctMGMzNi00Zjk2LWEyZmUtMzkxZmY5ZTA1Y2JhXkEyXkFqcGdeQXVyNTU0NDY1NTQ@._V1_SX300.jpg', 'It\'s city girls vs country girls in the most competitive gymnastics showdown ever. Get ready to tumble in A SECOND CHANCE: RIVALS!..', 89),
(436, 'The Hard Way', 'English', 'Action', '2019-03-05', 5, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BNzUyYjFmNjYtOGY5OC00YjcxLTkxOTAtNzNiNTM0YTE5Nzk4XkEyXkFqcGdeQXVyOTE1NDAyNw@@._V1_SX300.jpg', 'After learning his brother died on a mission in Romania, a former soldier teams up with two allies to hunt down a mysterious enemy and exact revenge.', 92),
(437, 'Jimmy Carr: The Best of Ultimate Gold Greatest Hits', 'English', 'Comedy', '2019-03-12', 7, 'Lionsgate Films', 'https://m.media-amazon.com/images/M/MV5BMzkzMzU4ZDctY2E2OS00NTU5LTk0OGQtN2NjN2VkZjVlZDExXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Nothing is off limits as Jimmy Carr serves up the best jokes from his storied stand-up career in a special that\'s as inappropriate as it is hilarious.', 58),
(438, '15 August', 'N/A', 'Drama', '2019-03-29', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BZTBmZmJkM2QtYTRkMi00NmU4LTljNWQtYjkwNzhlNmM3ODdjXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'On India\'s Independence Day, a zany mishap in a Mumbai chawl disrupts a young love story while compelling the residents to unite in aid of a little boy.', 124),
(439, 'Antoine Griezmann: The Making of a Legend', 'N/A', 'Documentary', '2019-03-21', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BMmYyMGE5NjItNmRkZS00MDI3LWE4ZGItYjQxZmZkMWVjMjdjXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'With heart and determination, Antoine Griezmann overcame his small stature to become one of the world\'s top soccer players and a World Cup champion.', 60),
(440, 'Jai Mummy Di', 'Hindi', 'Comedy', '2020-01-17', 4, 'Legendary Entertainment', 'https://m.media-amazon.com/images/M/MV5BNjEyMjM0ZTYtNzY5Yy00YjE2LWFhZDUtYWY3YTVjOWE0MTAzXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Jai Mummy Di is a light-hearted family comedy that portrays the trials and tribulations a couple has to undergo due to the dynamics between their respective mothers.', 103),
(441, 'Time Out', 'Arabic', 'Comedy', '2019-02-21', 6, 'Illumination Entertainment', 'https://m.media-amazon.com/images/M/MV5BNTljMmM5NzAtMjZhNS00NGI3LWFmYmUtNWNkMWFjMzEwMDNiXkEyXkFqcGdeQXVyMjA4NzE5MTE@._V1_SX300.jpg', 'A woman who works as a DJ is known to live alone and has her own messy world, but when she meets a teacher who is always serious and well organized, the contradiction between their personalities result in many comedic situations.', 93),
(442, 'Ella Fitzgerald: Just One of Those Things', 'English', 'Documentary', '2020-09-11', 7, 'DreamWorks Animation', 'https://m.media-amazon.com/images/M/MV5BYjgxMjVhNDAtMDgxMC00Mzk4LWE1NjUtZDRhZWM4MjA0ZmI4XkEyXkFqcGdeQXVyMzkxNDIzNQ@@._V1_SX300.jpg', 'Canvassing six decades of Ella Fitzgerald\'s astonishing trajectory from a teenager living on the streets of Harlem to her life changing appearance at the Apollo Theatre, JUST ONE OF THOSE THINGS illustrates her sublime transformation, reconstructing the stale stock narrative into a well-rounded examination of her mixed fortunes.', 89),
(443, 'Below Zero', 'Spanish', 'Action', '2021-01-29', 6, 'Metro-Goldwyn-Mayer (MGM)', 'https://m.media-amazon.com/images/M/MV5BM2Q1MmM4OGItNzc2Mi00Njc0LTllNmMtNTQxNTZmMGI0YWUxXkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg', 'On a lonely road, a prison transport is brutally assaulted. Martin, the policeman who was driving, survives and fortifies his position while the con men search for a way to finish him.', 106),
(444, 'Children of the Sea', 'Japanese', 'Animation', '2019-12-05', 6, 'Universal Pictures', 'https://m.media-amazon.com/images/M/MV5BOGNiYTQwMWQtNjQ0Ny00YTk4LTg4YTEtYmQyNDY5ZmNmYjVlXkEyXkFqcGdeQXVyMTI0NjU1NjEz._V1_SX300.jpg', 'Ruka is a young girl whose parents are separated and whose father works in an aquarium. When two boys, Umi and Sora, who were raised in the sea by dugongs, are brought to the aquarium, Ruka feels drawn to them and begins to realize that she has the same sort of supernatural connection to the ocean that they do. Umi and Sora\'s special power seems to be connected to strange events that have been occurring more and more frequently, such as the appearance of sea creatures far from their home territory and the disappearance of aquarium animals around the world.', 111),
(445, 'The Show Must Go On: The Queen + Adam Lambert Story', 'English', 'Documentary', '2019-04-29', 8, 'Sony Pictures Animation', 'https://m.media-amazon.com/images/M/MV5BNTU5YjJkYjYtNzRkMi00NGQ2LWE0MTQtNWFmYmU0OWFmMTBjXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'A documentary chronicling Queen and Lambert\'s incredible journey since they first shared the stage together on \"American Idol\" in 2009.', 86),
(446, 'Ali & Alia', 'Arabic', 'Drama', '2020-05-12', 5, 'Warner Bros.', 'https://m.media-amazon.com/images/M/MV5BMzk4NzAzMDUtZmI1NC00ODVjLTllMGYtMTFjMTc1NjQxNmY4XkEyXkFqcGdeQXVyOTk4NDQwMDM@._V1_SX300.jpg', 'Ali and Alia are childhood neighbors that fell in love with each other, but bigger events occur in their lives which gets them separated. Ali seeks to maintain Alia\'s heart even if it is through substance abuse.', 105),
(447, 'Edoardo Ferrario: Temi Caldi', 'Italian', 'Comedy', '2019-03-15', 6, 'A24', 'https://m.media-amazon.com/images/M/MV5BZGRmYmQwNjQtZTViNC00ZDE1LThjMTItNTNlNDAyNzU1OGFhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Edoardo is an Italian comedian. Similar to the other Italian comedy the comedian made fun of how awful the roads are in Rome. I had never heard anything about this, but its now been a major topic of comedy I\'ve heard twice. I feel if they lived in Las Vegas and seen the constant construction we have for years and years at time they may not think Rome is so bad. He also did a bit on horoscopes by Breszny and Paolo Fox who I have not heard of but I am curious to look up. He made a joke and the punch line was about a Briscola game gone wrong - the subtitles didn\'t translate the name, so I looked it up - it\'s the card came Trump. He closed with a bit doing impressions of other people, including Matthew McConaughey.', 65),
(448, 'Nate Bargatze: The Tennessee Kid', 'English', 'Comedy', '2019-03-26', 8, 'Columbia Pictures', 'https://m.media-amazon.com/images/M/MV5BNjYyNWNkMDktNDRkOS00ZWQxLTliNjEtYWM5ODIxNDdhMWRjXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Comic Nate Bargatze touches on air travel, cheap weddings, college football, chocolate milk and the perils of ordering coffee in this stand-up special.', 60),
(449, 'Holidate', 'English', 'Comedy', '2020-10-28', 6, 'Marvel Studios', 'https://m.media-amazon.com/images/M/MV5BYWVmYTFjODItOTY2Ni00NDhhLTk1ZDYtMzBmOGFhZTMyY2Q0XkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_SX300.jpg', 'Randomly meeting at a store return counter introduces Sloane to Jackson. Both tired of nightmare dates (him) and meddling family (her) during the holidays, they strike an arrangement, whereby they meet as a couple only during the holidays to make life at the very least tolerable. Slowly, so slowly, while scoffing at the cliches of romance (and to their surprise), their relationship grows into something deeper.', 104),
(450, 'Paranormal Investigation', 'French', 'Horror', '2018-12-01', 4, 'A24', 'https://m.media-amazon.com/images/M/MV5BNDk0ODg5NTctNDU2My00OTBiLTlkN2MtZmM3ODYwODE5NmU4XkEyXkFqcGdeQXVyODgzOTg4NzQ@._V1_SX300.jpg', 'When a young man becomes possessed after playing a Ouija game,a ghost hunter investigates the evil spirit dwelling within him.', 92);
