(211, 185, 7, 'A must-see film.', 9),
(212, 101, 2, 'In my eyes Iron Man is what could be called a perfect hero\'s journey. We start off with a guy who has a TON of issues, then he goes into a cave, and not a metaphorical one, but a actual one, and comes out a hero. The classic hero\'s journey done with so much effortless fun. The great thing about this whole situation though is that the audience is rooting for Tony, thanks to all the charisma and fun that Robert Downey Jr brings to the role. In fact, every character in this movie has a lot of fun personality. Jeff Bridges Obadiah Stane is simultaneously terrifying and funny at the same time. Gwyneth Paltrow and Terrence Howard also bring some big personality to their roles of Pepper Potts and James Rhodes. The visual effects in this movie are also astounding at times, and this movie is now fifteen years old! I also love the action in this flick, its heavy but also has a spark of humor and a lot of creativity thrown into the mix. Overall, this is a great, easily top 10 MCU film that kicks off the most profitable and well loved franchises in the history of cinema', 10),
(213, 101, 9, 'Absolutely the greatest solo hero film of all time! Iron man looks super cool with the classic red and gold highlights. The movie us an absolute classic in the MCU and is such a good movie that i can\'t stop re-watching it. The story is really great and how Tony famously crashed the mark 2 onto his Cobra oof. The fight scenes are just awesome with the mark 3 shooting rockets and the flying. This has to be the greatest movie and is definitely 1 of if not the best marvel movies ever.', 10),
(214, 101, 8, 'After a decade since this was released, it is still by far the greatest and most inspiring movie in the MCU ever made. I did not grow up reading the comics but thanks to this movie I discovered something great that I will love forever. Ironman 1, 2 & 3 inspired me in more ways than one. This will forever be a gem in the succeeding generations.', 10),
(215, 103, 4, 'This film is literally amazing Iron Man 2 is better than the first in case you can\'t argue with me right now but this song is let you better than a first I just think they done better job on this film and it said this ain\'t good at all but still it was great for what it was is definitely a 5-star', 10),
(216, 103, 16, 'I LOVEW THIS FILM :)) it is so intresting and filled wiyh many twists and plots throughout the whole thing, causing me to feel the adreniline rush', 10),
(217, 103, 13, 'perfect movie, perfect story, perfect execution. No wonder Iron Man is the most liked hero in the mcu.', 10),
(218, 103, 12, 'Iron Man 2 actually did better than the first one with interesting new characters and the mysterious past of Tony Stark with the relationship of his father and how he\'s being this man with money and on drugs that\'s killing him is actually a unique way just like they did in Spider-Man 2. The movie sets up a perfect villain and how it sets up the Avengers.', 9),
(219, 103, 3, 'Honestly, it’s my favourite Iron Man movie. The fight between Whiplash and Iron Man was mind-blowingly cool and the final showdown where Stark and Rhodes were back to back shooting was just so so satisfying.', 9),
(220, 104, 1, 'Great MCU movie. Iron Man 3 gets a bad wrap by a lot of fans because of the way they portrayed Mandarin, but looking at the movie as an actual film telling a story and not a perfect one-to-one creation of a comic, the Mandarin twist is very well executed and makes the story much less predictable. I really like how they force Tony to be stripped from all his armor and have to work with basically nothing. It really shows his adaptability and intelligence, and forces him to struggle against a threat that is more human then what he went up against in Avengers. They also show his anxiety throughout the movie after the attack on New York and it really adds an empathetic layer to the character that reminds you his snarky comments and one-liners are not who he truly is. I really love this movie and people need to talk about it more', 10),
(221, 104, 5, 'This movie perfectly encompasses the journey of Tony Stark. From a genius, billionaire, playboy philanthropist. He became a genius, billionaire, man in a loving relationship, ironman. Ironman 2 kind of shows how much Tony loves his suits and how they\'ve become who he his. Now in Ironman 3, he becomes a hero in himself, without his beloved suits. Tony Stark\'s journey through the movie is amazing and truly shows what an amazing person he his. At the beginning he says, I\'m not the man I was then. I\'ve changed. Of course he thinks he\'s changed, but there is still something wrong. Tony\'s suits kept him trapped in a fantasy. Like he\'s nothing without them. The technology he invents is amazing and this movie truly shows how much of a hero he is with and without his suits', 10),
(222, 104, 16, 'This is the best iron man movie compatible with Iron man 1 imo. This have the best character development for tony stark. He show that he is something without the suit. The final battle was amazing with many iron man suit. They save the real mandarin for Shang Chi. I don’t mind . The villlian is reasonable . We get to see the billionaire tony stark having an adventure on his own without any assist or any help. This is my favourite MCU movie. Love RDJ.', 10),
(223, 104, 11, 'It is a pretty good movie. I saw this movie a while back (3-4 months ago) but boy did I like this one. From the burning hot explosive fun of the Mandarin to the suspenseful Tony Stark moments and action scenes. This movie is a really strong addition to the Marvel canon for sure. I definitely recommend watching this movie. This movie is a Must-Watch!', 9),
(224, 104, 9, 'Probably my favorite Ironman movie! I loved seeing Tony Stark show off his creativity in this movie! I loved the chemistry between characters and the Mandarin twist. The Mandarin twist suits the characters and the guy who actually is the Mandarin looks like a Mandarin orange at the end of the movie. Worth several watches.', 9),
(225, 79, 1, 'Criminal Minds has become a big part of my life, it\'s my favorite show because it may be long but no episode made me want to click of. I love how they always work as a time to solve the case and sometimes have big problems and try to always make it work. Every character you get to know their story and will atleast once in the entire show will be more involved since it\'s a show about team work and not just one particular character. I love how no character is left out and is a massive part to the team even when some do eventully leave they still make it work. I must give special credit to AJ Cook who plays JJ i love JJ so much she has been their since the very start and mostly stays apart the time she went on maternity leave. Also another actor that deserves credit is Matthew Gray Gubler who plays Spencer reid i love Reid he\'s the genius of the group and is socally awkward but also so unique and special and is very loveable. Reids and JJ\'s friendship is amazing im so glad they stayed best friends and didn\'t do anything sexually because personally that would of ruined their whole past and relationship they grew the entire show. But in general the whole cast where amazing and some Unsubs like Mr Scratch are so unique to watch since on other Crime shows you may not seen unsubs like him. This show has enspired me when im older to try get into the crime part of our world and try help people since it\'s a real thing with people have to do everyday. Also to round this review i love how the whole team is always there for eachover if something happens helping them would always be their number 1 thing before anything else. Overall Criminal Minds is a great show and persoanlly worth the length since some of the last seasons could be your favorite.', 10),
(226, 79, 2, 'Amazing show. Favorite show at that. It is top tier to any other shows I\'ve watched and I\'ve watched some very good shows. But absolutely nothing can top this one. Fav characters are daddy Hotch and my wife Jennifer. My favorite ship is Jemily. And my favorite friendship is Derek and Garcia. Its so innocent and its gives everything it needs to. The episodes are amazing and in my opinion the best season was season 7 of course. My favorite team was together doing great things. They just ate it up. And they inspired me to want to become a profiler. Anyways the creator of this shows deserves the world espeicially cause he created one of my other favorite shows teen wolf. Amazing casting in both shows they fit their characters so well. Anyways thats all just amazing show.', 10),
(227, 79, 17, 'Been watching since pilot. And it is a show of a team of profilers stomping out evil, but what really touches my heart is that they are not only a team but  a family. It\'s crazy I see it as family show at times because of the beautiful relationship each has with one another. This cast is phenomenal and has touched my heart for almost 2 decades.That hard to do but CM Evolution has cultivated a trend of excellence and perfection. The cast, crew, all those amazing artists still have never failed my expectations  but evolution is the perfect new beginning and something even grander. CM is perfect and cast and CM has become a big chunk of my life and will always be my favorite show of all times! WHEELS UP 4 LIFE!!', 10),
(228, 79, 14, 'If there is a show to make you laugh, cry, almost have a panic attack and not want to quit watching, this is it. I have seen so many other shows and none of them really compare to this. I could watch this all day long. When the show mixes the character\'s personal lives with their job it makes it so much better. It will always keep you on your toes. If you just want something on in the background this isn\'t for you because you will definitely stop and start watching. Watching how they solve the cases just blows my mind. They get into their minds without even knowing them. Like how crazy is that! Anyways to wrap up I\'ll tell you this show is a amazing, I love it and I feel really connected to the characters and I love it, did I mention that? :)', 9),
(229, 79, 16, 'Criminal Minds was probably the best show I have ever watched. I have watched a few shows and they were great! But, Criminal Minds was different, I watched that show every day for hours and hours and I thought I was on the team too. It was so cool seeing them catch serial killers and save lives. Criminal Minds was apart of my life for a couple of months. Every character was different and I loved that about the show. They made the BAU the BAU! Criminal minds will give you a lot of emotions. If there is a show that can make you laugh, cry, and maybe have a panic attack it\'s Criminal Minds. I always saw Criminal minds and didn\'t really care about watching it. Out of nowhere, I said, \'Why not?\' and I don\'t regret watching it. There are so many cases and all of them I love. I loved to solve the case and use my brain and see what would happen. Even though Aaron Hotchner left the BAU it was still a great show. There were so many bad things that happened but they were able to get through it. My favorite character was Dr. Spencer Reid. I don\'t know why but he is just cute, very smart, and caring to his team. All of the team was good but Reid was just different for me. Criminal Minds is a must if you watch Netflix. This show made me really happy and I am really sad that the show came to an end.  I wish I can go back to me watching the first episode so I can watch the show and have no idea what\'s coming next. I would go on and on about the best parts of the show but it\'s better you find out yourself. If you do watch the show from this review, hope you loved the show just as I did!', 9),
